(1, 'Prime Delights', 'prime-delights', 'Prime Delights', 'Indulge in culinary perfection with Prime Food. Unleash a world of exquisite flavors, quality ingredients, and exceptional taste for a dining experience like no other.', 1706, 1706, 1805, 1, 1, '2024-03-11 21:40:38', '2024-03-12 03:58:08', NULL),
(2, 'Harvest Haven', 'harvest-haven', 'Harvest Haven', 'Savor the essence of freshness with Harvest Haven, your go-to destination for premium quality, farm-fresh food and vegetables. Pure, natural goodness delivered to your doorstep.', 1708, 1708, NULL, 1, 1, '2024-03-11 21:42:44', '2024-03-11 21:42:44', NULL),
(3, 'Nourish Naturally', 'nourish-naturally', 'Nourish Naturally', 'Indulge in pure, wholesome goodness with our organic food. Cultivate your well-being with every bite, embracing a healthier, sustainable lifestyle.', 1710, 1710, 1803, 1, 1, '2024-03-11 21:44:39', '2024-03-12 01:46:45', NULL),
(4, 'Nourish to Flourish', 'nourish-to-flourish', 'Nourish to Flourish', 'Elevate your well-being with Nourish to Flourish. Discover a delicious array of wholesome, nutrient-packed options that make healthy eating an irresistible journey', 1712, 1712, NULL, 1, 1, '2024-03-11 21:47:19', '2024-03-11 21:47:19', NULL),
(5, 'Nutrient Nosh', 'nutrient-nosh', 'Nutrient Nosh', 'Elevate your well-being with NourishNosh – your go-to source for delicious and nutritious food that fuels a healthy lifestyle. Eat well, live well!', 1714, 1714, NULL, 1, 1, '2024-03-11 21:53:27', '2024-03-11 21:53:27', NULL),
(6, 'Vegan Delights', 'vegan-delights', 'Vegan Delights', 'PureVibe brings you a divine fusion of flavor and health with our delectable range of vegan delights. Savor the goodness, embrace the vitality.', 1716, 1716, NULL, 1, 1, '2024-03-11 21:56:20', '2024-03-11 21:56:20', NULL),
(7, 'Nature\'s Bounty', 'nature-s-bounty', 'Nature\'s Bounty', 'Experience pure goodness with CarrotCraft – your source for premium organic carrots. Delight in the crisp, natural flavor of wholesome, farm-fresh carrots, nurtured with care.', 1718, 1718, NULL, 1, 1, '2024-03-11 22:01:22', '2024-03-11 22:01:22', NULL),
(8, 'Dough Delights', 'dough-delights', 'Dough Delights', 'Indulge in the artistry of flavor with Dough Delights – your go-to destination for exquisite bread and pastries that elevate every moment with delicious perfection.', 1720, 1720, NULL, 1, 1, '2024-03-11 22:03:48', '2024-03-11 22:03:48', NULL),
(9, 'Crust Bakery', 'crust-bakery', 'Crust Bakery', 'Welcome to Crust Bakery – where every loaf is a masterpiece. Immerse yourself in the art of artisanal baking with CrustCraft, your go-to destination for exceptional bread experiences.', 1722, 1722, NULL, 1, 1, '2024-03-11 22:09:26', '2024-03-11 22:09:26', NULL),
(10, 'Crumb Delights', 'crumb-delights', 'Crumb Delights', 'Indulge in artisanal delights at CraveCraft Bakery. From flaky croissants to decadent cakes, we bake with passion and precision, ensuring every bite is a taste of perfection. Satisfy your cravings with our freshly crafted treats today.', 1724, 1724, NULL, 1, 1, '2024-03-11 22:11:16', '2024-03-11 22:11:16', NULL),
(11, 'Delight Bake', 'delight-bake', 'Delight Bake', 'Delight Bake - Crafting Happiness Daily. Indulge in our irresistible creations, from fluffy pastries to artisanal bread. Experience the epitome of taste and freshness with every bite.', 1726, 1726, 1805, 1, 1, '2024-03-11 22:13:46', '2024-03-12 01:48:04', NULL),
(12, 'Sweet Fusion', 'sweet-fusion', 'Sweet Fusion', 'Indulge in heavenly delights at SweetFusion Bakery, where every bite is a symphony of flavors. From artisanal bread to decadent pastries, we blend passion and precision to create unforgettable treats for every palate.', NULL, 1728, NULL, 1, 1, '2024-03-11 22:16:18', '2024-03-11 22:16:18', NULL),
(13, 'Artisanal Bakes', 'artisanal-bakes', 'Artisanal Bakes', 'Savor the handmade charm of Crust & Crumb Artisanal Bakes. From crusty baguettes to fluffy sourdoughs, indulge in our meticulously crafted bread, baked with love and tradition for a truly unforgettable taste experience.', 1730, 1730, NULL, 1, 1, '2024-03-11 22:18:18', '2024-03-11 22:18:18', NULL),
(14, 'Crumb Craze', 'crumb-craze', 'Crumb Craze', 'Satisfy your cravings with CrumbCraze bakery! Indulge in artisanal delights bursting with flavor. From fluffy pastries to decadent cakes, every bite is a celebration of taste. Join the CrumbCraze craze today!', 1732, 1732, NULL, 1, 1, '2024-03-11 22:20:11', '2024-03-11 22:20:11', NULL),
(15, 'Luxe Nest', 'luxe-nest', 'Luxe Nest', 'Elevate your space with LuxeNest furniture. Crafted for comfort and style, our pieces blend modern design with timeless elegance. Redefine your home\'s ambiance with quality and sophistication.', 1734, 1734, NULL, 1, 1, '2024-03-11 22:22:02', '2024-03-11 22:22:02', NULL),
(16, 'Cozy Chic', 'cozy-chic', 'Cozy Chic', 'Transforming Spaces. Quality furniture curated for comfort and style. Elevate your home with our range of cozy essentials. Find your perfect piece and make every room a sanctuary.', 1736, 1736, NULL, 1, 1, '2024-03-11 22:24:14', '2024-03-11 22:24:14', NULL),
(17, 'Comfy Craft', 'comfy-craft', 'Comfy Craft', 'Transforming Spaces. Discover stylish and functional furniture solutions crafted with precision and care. Elevate your home with our range of comfortable and durable pieces designed to complement your lifestyle.', 1738, 1738, NULL, 1, 1, '2024-03-11 22:25:14', '2024-03-11 22:25:14', NULL),
(18, 'Decor Vogue', 'decor-vogue', 'Decor Vogue', 'Elevate your living spaces with DecorVogue! From chic accents to timeless pieces, we bring you quality products that redefine elegance and transform your house into a home.', 1740, 1740, 1807, 1, 1, '2024-03-11 22:27:05', '2024-03-12 01:49:48', NULL),
(19, 'Aura Decor', 'aura-decor', 'Aura Decor', 'Discover curated interior solutions blending style and functionality. Transform any room into a haven of comfort and beauty with our exquisite range of furniture and décor. Redefine your home, one piece at a time.', 1742, 1742, NULL, 1, 1, '2024-03-11 22:29:55', '2024-03-11 22:29:55', NULL),
(20, 'Elevate Decor', 'elevate-decor', 'Elevate Decor', 'From modern minimalism to classic elegance, our designs enrich spaces with quality craftsmanship and enduring style, making every corner of your home a reflection of your impeccable taste.', 1744, 1744, NULL, 1, 1, '2024-03-11 22:31:44', '2024-03-11 22:31:44', NULL),
(21, 'Furni Vibe', 'furni-vibe', 'Furni Vibe', 'Elevate your living spaces with our exquisite house furniture collection, meticulously crafted to redefine your home\'s aesthetic. Welcome a harmonious blend of style and relaxation into every corner.', 1746, 1746, NULL, 1, 1, '2024-03-11 22:38:02', '2024-03-11 22:38:02', NULL),
(22, 'Elegance In Motion', 'elegance-in-motion', 'Elegance In Motion', 'Immerse yourself in a world where sophistication meets innovation. From chic essentials to bold statements, our curated collections redefine fashion, making every step a runway moment.', 1748, 1748, NULL, 1, 1, '2024-03-11 22:42:15', '2024-03-11 22:42:15', NULL),
(23, 'Epic Threads', 'epic-threads', 'Epic Threads', 'Step into a world of sartorial excellence with EpicThreads. Unleash your unique style at our fashion store, where every piece tells a story of sophistication and individuality.', 1750, 1750, NULL, 1, 1, '2024-03-11 22:44:11', '2024-03-11 22:44:11', NULL),
(24, 'Chic Boutique', 'chic-boutique', 'Chic Boutique', 'Uncover unique styles that speak to your individuality. From timeless classics to trendy treasures, our boutique is your destination for a personalized shopping experience that transcends trends.', 1752, 1752, 1809, 1, 1, '2024-03-11 22:46:00', '2024-03-12 01:50:57', NULL),
(25, 'Belle Boutique', 'belle-boutique', 'Belle Boutique', 'Discover curated collections that blend timeless elegance with contemporary style. Elevate your wardrobe and express your unique flair with our carefully selected fashion pieces.', 1754, 1754, NULL, 1, 1, '2024-03-11 22:53:23', '2024-03-11 22:53:23', NULL),
(26, 'Fashion Sanctuary', 'fashion-sanctuary', 'Fashion Sanctuary', 'Our fashion boutique curates the latest trends, offering a unique blend of elegance and flair. Elevate your wardrobe with handpicked pieces that redefine your fashion statement, making every moment a runway.', 1756, 1756, NULL, 1, 1, '2024-03-11 22:54:32', '2024-03-11 22:54:32', NULL),
(27, 'Couture Vista', 'couture-vista', 'Couture Vista', 'Our boutique curates timeless elegance and trendsetting designs. Discover a unique blend of sophistication and flair, creating a personalized fashion journey that transcends the ordinary.', 1758, 1758, NULL, 1, 1, '2024-03-11 22:56:11', '2024-03-11 22:56:11', NULL),
(28, 'Eleganza Threads', 'eleganza-threads', 'Eleganza Threads', 'Our fashion transcends trends, blending sophistication with contemporary flair. Discover timeless pieces that redefine your wardrobe, where every stitch tells a story of confidence, creativity, and chic elegance.', 1760, 1760, NULL, 1, 1, '2024-03-11 22:59:41', '2024-03-11 22:59:41', NULL),
(29, 'Juice Haven', 'juice-haven', 'Juice Haven', 'Our handcrafted juices are a celebration of pure, vibrant ingredients, providing an oasis of vitality and taste. Sip, savor, and energize with every drop from the heart of freshness.', 1762, 1762, NULL, 1, 1, '2024-03-11 23:02:28', '2024-03-11 23:02:28', NULL),
(30, 'Zestify Juicery', 'zestify-juicery', 'Zestify Juicery', 'Zestify Juicery crafts a symphony of flavors in every sip. Elevate your taste experience with our handpicked, nutrient-packed blends that redefine the essence of pure, revitalizing juice.', 1764, 1764, NULL, 1, 1, '2024-03-11 23:05:41', '2024-03-11 23:05:41', NULL),
(31, 'Zest Craft', 'zest-craft', 'ZestCraft', 'Elevate your senses with our handcrafted juices and beverages, meticulously blended to perfection. Experience a symphony of flavors that invigorates, replenishes, and leaves you craving for more.', 1766, 1766, NULL, 1, 1, '2024-03-11 23:08:20', '2024-03-11 23:08:20', NULL),
(32, 'Sip and Thrive', 'sip-and-thrive', 'Sip and Thrive', 'Our handcrafted juices burst with natural flavors and nutrients, offering a vibrant blend of health and taste. Elevate your vitality with every sip and embrace a healthier, zestier lifestyle with Zestify.', 1768, 1768, NULL, 1, 1, '2024-03-11 23:11:27', '2024-03-11 23:11:27', NULL),
(33, 'Greens Bliss', 'greens-bliss', 'Greens Bliss', 'Our Vegetarian Juice collection is a symphony of vibrant flavors, packed with the goodness of fruits and vegetables. Elevate your health and indulge in a refreshing journey with every sip.', 1770, 1770, NULL, 1, 1, '2024-03-11 23:13:03', '2024-03-11 23:13:03', NULL),
(34, 'Pure Greens', 'pure-greens', 'Pure Greens', 'Our vegan juices are a symphony of natural goodness, crafted with love. Refresh your senses and embrace a healthier you with each sip, knowing it\'s not just a drink; it\'s a mindful choice for your well-being and the planet.', 1772, 1772, 1811, 1, 1, '2024-03-11 23:14:32', '2024-03-12 01:52:11', NULL),
(35, 'Farm Fusion', 'farm-fusion', 'Farm Fusion', 'Farm Fusion brings you a medley of farm-fresh vegetables and fruits, curated for freshness and flavor. Elevate your plate with our premium produce, straight from the heart of the harvest.', 1774, 1774, NULL, 1, 1, '2024-03-11 23:16:32', '2024-03-11 23:16:32', NULL),
(36, 'Ink Voyage', 'ink-voyage', 'Ink Voyage', 'Welcome to InkVoyage, where every book is a journey waiting to unfold. Immerse yourself in the magic of literature. Explore, learn, and escape into worlds crafted by words—because at InkVoyage, stories are not just read; they are experienced.', 1776, 1776, NULL, 1, 1, '2024-03-11 23:19:52', '2024-03-11 23:19:52', NULL),
(37, 'Page Turner', 'page-turner', 'Page Turner', 'Where Every Page Sparks Imagination. Discover a world of captivating stories, insightful knowledge, and endless adventures. Dive into our curated collection of books that will ignite your curiosity and leave you yearning for more.', 1778, 1778, NULL, 1, 1, '2024-03-11 23:22:54', '2024-03-11 23:22:54', NULL),
(38, 'Ink Scroll', 'ink-scroll', 'Ink Scroll', 'Immerse yourself in captivating stories, unlock your imagination, and embark on literary journeys that transcend time. Welcome to a realm where books come alive.', 1780, 1780, NULL, 1, 1, '2024-03-12 00:17:27', '2024-03-12 00:17:27', NULL),
(39, 'Allure Book', 'allure-book', 'Allure Book', 'Experience the allure of Book, where every page holds a spectrum of wisdom. Dive into a world of boundless knowledge, adorned in shades of blue. Discover the joy of learning through the captivating journey of the written word.', 1782, 1782, NULL, 1, 1, '2024-03-12 00:21:31', '2024-03-12 00:21:31', NULL),
(40, 'Page Paradise', 'page-paradise', 'Page Paradise', 'Step into the enchanting world of Page Paradise, where every shelf is a story waiting to be discovered. Immerse yourself in a curated collection of literary wonders and let your love for books come alive in our haven of reading delights.', 1784, 1784, NULL, 1, 1, '2024-03-12 00:22:58', '2024-03-12 00:22:58', NULL),
(41, 'Novel Nectar', 'novel-nectar', 'Novel Nectar', 'Unleash your senses with our exquisite blend of unique flavors. Elevate every moment with our premium collection of handcrafted beverages. Indulge in innovation, savor the extraordinary.', 1786, 1786, NULL, 1, 1, '2024-03-12 00:25:44', '2024-03-12 00:25:44', NULL),
(42, 'Book Boudoir', 'book-boudoir', 'Book Boudoir', 'Elevate your reading experience with curated literary treasures. Immerse yourself in a world of captivating stories and exclusive editions. Unleash the bibliophile in you with Book Boudoir – where every page holds a new adventure.', 1788, 1788, 1813, 1, 1, '2024-03-12 00:27:18', '2024-03-12 01:53:05', NULL);
