INSERT INTO `categories` (`id`, `name`, `slug`, `meta_title`, `meta_description`, `category_meta_image_id`, `description`, `category_image_id`, `category_icon_id`, `status`, `type`, `commission_rate`, `parent_id`, `created_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Vegetables & Fruits', 'vegetables-fruits', NULL, NULL, NULL, 'Vegetables and fruits are essential components of a balanced diet, providing a wide range of nutrients, vitamins, and minerals that promote overall health. Vegetables encompass a diverse group of plant-based foods, while fruits are naturally sweet and colorful delights that offer a variety of flavors and health benefits. Incorporating a colorful array of vegetables and fruits into your meals can contribute to improved well-being and support various bodily functions.', 395, 266, 1, 'product', 1.00, NULL, 1, '2023-08-24 00:54:10', '2023-08-31 22:11:19', NULL),
(2, 'Beverages', 'beverages', NULL, NULL, NULL, 'Beverages are liquid refreshments that play a vital role in hydration and enjoyment. They encompass a wide spectrum, from essential options like water and herbal teas to flavorful choices like juices, sodas, coffee, and alcoholic drinks. Beverages can quench thirst, provide essential nutrients, and offer social and cultural significance in various societies. Selecting beverages mindfully can contribute to maintaining proper hydration and aligning with personal health goals.', 396, 267, 1, 'product', 1.00, NULL, 1, '2023-08-24 00:54:37', '2023-08-31 22:11:32', NULL),
(3, 'Daily Breakfast', 'daily-breakfast', NULL, NULL, NULL, 'Breakfast is often hailed as the most important meal of the day, providing a nutritious start to one\'s morning. It typically includes a variety of foods such as grains (like cereal or toast), dairy products like milk, yogurt, and cheese, as well as fruits and proteins. Dairy products, including milk and its derivatives, are rich sources of calcium and essential nutrients that support bone health and overall well-being. Incorporating a balanced breakfast with dairy can provide sustained energy and contribute to a wholesome diet.', NULL, 269, 1, 'product', NULL, NULL, 1, '2023-08-24 00:55:11', '2023-08-26 04:21:46', NULL),
(4, 'Frozen Foods', 'frozen-foods', NULL, NULL, NULL, 'Frozen foods are convenient and versatile food items that have been preserved through freezing. They encompass a wide range of options, from frozen fruits and vegetables to ready-to-eat meals, pizzas, and desserts. Freezing helps lock in nutrients and flavors, extending the shelf life of perishable items. While frozen foods offer convenience, it\'s important to read labels for nutritional information and choose options with balanced ingredients. Properly incorporating frozen foods into a diet can simplify meal preparation while maintaining nutritional value.', NULL, 271, 1, 'product', NULL, NULL, 1, '2023-08-24 00:56:18', '2023-08-26 04:21:56', NULL),
(5, 'Biscuits & Snacks', 'biscuits-snacks', NULL, NULL, NULL, 'Biscuits and snacks are popular food choices enjoyed for their convenience and variety of flavors. Biscuits, often known as cookies in some regions, come in various textures and tastes, from crispy to soft and sweet to savory. Snacks encompass a broader category, including chips, nuts, granola bars, and more, offering quick bites for on-the-go consumption. While indulging in these treats, it\'s important to strike a balance between enjoying their flavors and considering their nutritional content. Opting for healthier snack options can contribute to a well-rounded diet.', NULL, 272, 1, 'product', NULL, NULL, 1, '2023-08-24 00:56:41', '2023-08-26 04:22:08', NULL),
(6, 'Grocery & Staples', 'grocery-staples', NULL, NULL, NULL, 'Groceries and staples are the foundation of a well-stocked kitchen, encompassing essential food items that form the basis of meals. This category includes non-perishable items like rice, pasta, flour, oils, canned goods, and spices. Staples provide the building blocks for a wide range of recipes, allowing for diverse culinary creations. Careful grocery planning ensures a pantry stocked with nutritious and versatile options, enabling efficient meal preparation while accommodating individual dietary preferences.', 394, 273, 1, 'product', NULL, NULL, 1, '2023-08-24 00:57:07', '2023-08-31 22:11:42', NULL),
(7, 'Wines & Soft Drinks', 'wines-soft-drinks', NULL, NULL, NULL, 'Wines and alcoholic drinks are enjoyed for their diverse flavors and social significance. Wines, produced from fermented grapes, offer a wide range of styles from red to white to rosé, each with unique characteristics. Alcoholic drinks encompass a variety of beverages, including beer, spirits, cocktails, and liqueurs. While moderation can enhance social experiences, it\'s important to be mindful of consumption to avoid negative health effects. Responsible and informed enjoyment of wines and alcoholic drinks can be part of a balanced lifestyle.', NULL, 274, 1, 'product', 5.00, NULL, 1, '2023-08-24 00:57:35', '2023-08-26 04:22:40', NULL),
(8, 'Milk & Dairy Products', 'milk-dairy-products', NULL, NULL, NULL, 'Milk and dairy products are essential sources of nutrients, particularly calcium and protein, that play a crucial role in supporting bone health, muscle function, and overall well-being. Dairy products include milk, cheese, yogurt, and butter, each offering distinct textures and flavors. While dairy can be a valuable part of a diet, individuals with lactose intolerance or dietary preferences may opt for plant-based alternatives like almond, soy, or oat milk. Incorporating a variety of dairy or dairy-free options can contribute to a balanced intake of nutrients.', NULL, 275, 1, 'product', NULL, NULL, 1, '2023-08-24 00:58:02', '2023-08-26 04:22:59', NULL),
(9, 'Pet Shop', 'pet-shop', NULL, NULL, NULL, 'Our pet shop offers only top-notch, premium quality products, ensuring customer satisfaction and trust. We have a wide variety of pet supplies, including food, toys, grooming essentials, and accessories, catering to every pet owner\'s needs. Our products are reasonably priced, offering great value for money, attracting price-conscious customers.', NULL, 276, 1, 'product', NULL, NULL, 1, '2023-08-24 00:58:23', '2023-08-26 04:23:08', NULL),
(10, 'Meats & Seafood', 'meats-seafood', NULL, NULL, NULL, 'Meats and seafood are valuable sources of protein, essential nutrients, and distinct flavors in a balanced diet. Meats, which include options like beef, poultry, and pork, offer a range of textures and tastes, while seafood encompasses fish and shellfish with their unique profiles. These foods provide essential amino acids, vitamins, and minerals that support muscle growth, immune function, and overall health. Choosing lean cuts and sustainable seafood options contributes to a nutritious diet while considering environmental and ethical factors.', NULL, 268, 1, 'product', NULL, NULL, 1, '2023-08-24 00:59:07', '2023-08-26 04:23:23', NULL),
(11, 'Decorations', 'decorations', NULL, NULL, NULL, 'Furniture and decorations are integral components of interior design, transforming living spaces into functional and aesthetically pleasing environments. Furniture includes items like chairs, tables, sofas, and beds, which serve both practical and decorative purposes. Decorations encompass a wide variety of objects such as artwork, vases, rugs, and ornaments that add personality and style to a room. Thoughtfully chosen furniture and decorations contribute to the ambiance and functionality of a space, reflecting individual preferences and creating a harmonious living environment.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:02:29', '2023-08-24 01:10:12', NULL),
(12, 'Bed linen', 'bed-linen', NULL, NULL, NULL, 'Bed linen, including sheets, pillowcases, duvet covers, and bedspreads, plays a vital role in enhancing sleep comfort and bedroom aesthetics. Made from various materials like cotton, linen, or silk, bed linen offers different textures and levels of breathability. Beyond their functional aspect, bed linens contribute to bedroom decor and can be coordinated to match or complement the overall interior design. Choosing high-quality bed linens can promote better sleep quality and contribute to creating a cozy and inviting bedroom atmosphere.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:02:53', '2023-08-24 01:10:03', NULL),
(13, 'Blankets', 'blankets', NULL, NULL, NULL, 'Blankets are cozy and versatile textile items that provide warmth and comfort. They come in various materials, such as fleece, wool, cotton, and acrylic, offering different levels of insulation. Blankets can be used on beds, couches, or as throws, adding both functionality and style to living spaces. They also come in a range of designs and colors, making them an attractive accessory for interior decor. Whether used for extra warmth during cold nights or as decorative accents, blankets are an essential element in creating a comfortable and inviting atmosphere.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:03:57', '2023-08-24 01:09:53', NULL),
(14, 'Cushions', 'cushions', NULL, NULL, NULL, 'Cushions, also known as throw pillows or decorative pillows, are soft furnishings that enhance both the comfort and aesthetics of furniture. These versatile accessories come in various shapes, sizes, and fabrics, allowing for creative mixing and matching to complement a room\'s decor. Cushions can provide added support and coziness to seating areas while serving as decorative accents that bring color, texture, and style to a space. Whether arranged on sofas, chairs, or beds, cushions play a significant role in creating an inviting and visually appealing environment.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:04:26', '2023-08-24 01:09:40', NULL),
(15, 'Sofas', 'sofas', NULL, NULL, NULL, 'A sofa, often referred to as a couch, is a piece of furniture designed for seating multiple people comfortably. Sofas are a fundamental component of living rooms, lounges, and other social spaces. They come in various sizes, styles, and materials, catering to different preferences and interior design themes.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:05:37', '2023-08-24 01:09:31', NULL),
(16, 'Chairs', 'chairs', NULL, NULL, NULL, 'Chairs are versatile pieces of furniture designed for seating comfort and support. They come in a wide range of styles, sizes, and materials to suit various functional and aesthetic needs. Chairs serve as essential seating options for different areas of the home, offices, and various public spaces.', NULL, NULL, 1, 'product', NULL, 17, 1, '2023-08-24 01:06:23', '2023-08-24 01:09:16', NULL),
(17, 'Furniture', 'furniture', NULL, NULL, NULL, 'Furniture encompasses a wide range of functional and decorative items designed to enhance living and working spaces. It includes various pieces that serve practical purposes while contributing to the overall aesthetics and ambiance of a room or environment. Furniture is an essential aspect of interior design and plays a crucial role in creating comfortable and functional living, working, and recreational spaces.', NULL, 315, 1, 'product', NULL, NULL, 1, '2023-08-24 01:09:02', '2023-08-31 02:38:49', NULL),
(18, 'Beauty', 'beauty', NULL, NULL, NULL, 'Beauty is a concept that encompasses various aspects related to aesthetics, appearance, and the perception of attractiveness. It is a multifaceted idea that can be understood differently across cultures, individuals, and contexts.', 392, 311, 1, 'product', NULL, NULL, 1, '2023-08-24 01:14:42', '2023-08-31 22:11:08', NULL),
(19, 'Fashion', 'fashion', NULL, NULL, NULL, 'Fashion refers to the prevailing style or trend in clothing, accessories, footwear, makeup, and hairstyling that is popular at a particular time and place. It\'s a dynamic and ever-evolving aspect of culture that reflects social, economic, and cultural influences', 382, 314, 1, 'product', NULL, NULL, 1, '2023-08-24 01:15:24', '2023-08-31 21:29:40', NULL),
(20, 'Accessories', 'accessories', NULL, NULL, NULL, 'Accessories are items that complement and enhance an individual\'s overall appearance and style. They are an essential part of fashion and can add depth, personality, and flair to outfits. Accessories encompass a wide range of items, from jewelry and bags to scarves, hats, belts, and more.', 380, 318, 1, 'product', NULL, NULL, 1, '2023-08-30 22:00:03', '2023-08-31 21:29:24', NULL),
(21, 'Sports', 'sports', NULL, NULL, NULL, 'Sports encompass a wide range of physical activities and competitive games that involve skill, athleticism, strategy, and often teamwork. Sports have a significant impact on individuals, communities, and societies, fostering physical fitness, social interaction, entertainment, and even professional careers', 378, 661, 1, 'product', NULL, NULL, 1, '2023-08-30 22:01:06', '2023-09-04 19:57:11', NULL),
(22, 'Electronics', 'electronics', NULL, NULL, NULL, 'Electronics refer to devices and systems that utilize the principles of electronics and electromagnetism to control and manipulate electrical signals. Electronics play a crucial role in modern society, impacting communication, entertainment, transportation, healthcare, and various other sectors', 393, 313, 1, 'product', NULL, NULL, 1, '2023-08-30 22:02:47', '2023-08-31 22:10:46', NULL),
(23, 'Oils, Refined & Ghee', 'oils-refined-ghee', NULL, NULL, NULL, 'Oils, including refined oils and ghee, are essential components of cooking and culinary traditions worldwide. These fats play a significant role in enhancing the flavor, texture, and nutritional profile of dishes. Refined oils are obtained through a meticulous process that eliminates impurities, resulting in neutral-tasting oils with higher smoke points', NULL, NULL, 1, 'product', NULL, NULL, 1, '2023-08-30 22:05:10', '2023-08-30 22:05:56', '2023-08-30 22:05:56'),
