INSERT INTO `faqs` (`id`, `title`, `description`, `created_by_id`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'How can I track my online order?', 'Most online retailers provide a tracking number in your order confirmation email. You can use this number on the carrier\'s website to track the status and location of your package. Additionally, some carriers offer detailed tracking information, including estimated delivery times and real-time updates on the package\'s journey.', 1, 1, '2023-09-29 00:17:39', '2023-09-29 00:21:30', NULL),
(2, 'What is the return policy for most products?', 'Return policies vary by retailer. Typically, there is a specified window (e.g., 30 days) for returns. Check the retailer\'s website or contact customer service for specific details. Some retailers may offer free returns, while others may deduct return shipping costs from your refund. It\'s crucial to review the policy before making a purchase to ensure you\'re comfortable with the terms.', 1, 1, '2023-09-29 00:17:56', '2023-09-29 00:21:40', NULL),
(3, 'How do I find the best deals and discounts when shopping online?', 'Subscribe to newsletters, follow retailers on social media, and use price comparison tools. Many retailers also offer discounts for first-time shoppers or during seasonal sales. Additionally, consider browser extensions that automatically apply coupon codes at checkout, maximizing your savings.', 1, 1, '2023-09-29 00:18:31', '2023-09-29 00:22:16', NULL),
(4, 'Are online reviews reliable for making purchasing decisions?', 'Online reviews can be helpful, but it\'s essential to consider the overall sentiment and read multiple reviews. Look for detailed reviews that discuss both positive and negative aspects of the product. Consider the credibility of the source, and be aware that some reviews may be influenced by factors like personal preferences or sponsored content.', 1, 1, '2023-09-29 00:18:43', '2023-09-29 00:23:22', NULL),
(5, 'How can I extend the lifespan of electronic devices?', 'Keep devices in a cool and dry place, install software updates regularly, use protective cases, and follow manufacturer recommendations for charging. Avoid exposing devices to extreme temperatures, and consider investing in surge protectors to safeguard against electrical issues.', 1, 1, '2023-09-29 00:18:57', '2023-09-29 00:24:17', NULL),
(6, 'What should I do if a product arrives damaged?', 'Contact the retailer\'s customer service immediately. Most retailers have a process for handling damaged or defective items and may offer a replacement or refund. Take clear photos of the damage and provide detailed information to expedite the resolution process. Many retailers prioritize customer satisfaction and will work to resolve the issue promptly.', 1, 1, '2023-09-29 00:19:11', '2023-09-29 00:26:21', NULL),
(7, 'Can I cancel an order after it has been placed?', 'It depends on the retailer and the stage of processing. Quickly contact customer service to inquire about cancellation possibilities. Some retailers have a short window for order cancellations, especially if the order has already been processed or shipped. Being proactive in reaching out can increase the chances of a successful cancellation.', 1, 1, '2023-09-29 00:19:28', '2023-09-29 00:26:34', NULL),
(8, 'How can I find out about product recalls?', 'Check the product\'s official website, the manufacturer\'s website, or government websites for recalls. You can also sign up for email alerts from consumer protection organizations. Additionally, following the manufacturer and relevant product safety organizations on social media can provide timely updates on recalls and safety concerns.', 1, 1, '2023-09-29 00:19:44', '2023-09-29 00:26:49', NULL),
(9, 'What is the difference between refurbished and new products?', 'Refurbished products have been repaired and tested to ensure functionality. They may show slight wear but are generally more affordable than new items. New products are unused and come in original packaging. When purchasing refurbished items, look for those certified by the manufacturer or a reputable third party to ensure quality and reliability.', 1, 1, '2023-09-29 00:19:59', '2023-09-29 00:27:01', NULL),
(10, 'How do I protect my personal information when shopping online?', 'Use secure websites (look for \"https\" in the URL), avoid public Wi-Fi for sensitive transactions, regularly update passwords, and be cautious about sharing unnecessary personal information. Additionally, consider using a virtual private network (VPN) for added security, and monitor your financial statements regularly for any unauthorized transactions. Staying vigilant and adopting secure online practices is key to protecting your personal information.', 1, 1, '2023-09-29 00:20:14', '2023-10-09 19:27:19', NULL);
