(1, 'Privacy Policy', 'privacy-policy', '<p><strong>Information Collection and Use</strong></p><p>We collect personal information to provide and improve our service. This may include your name, email address, phone number, postal address, and any other information you choose to provide to us. We use this information to communicate with you, fulfill your requests, and personalize your experience. Additionally, we may collect usage data such as your IP address, browser type, and device information to understand how our service is used and to improve user experience.</p><p><strong>Data Sharing and Disclosure</strong></p><p>We may share personal information with trusted third-party service providers to facilitate our service or to comply with legal obligations. These third parties are contractually obligated to use your personal information only as necessary to provide the services requested by us and to maintain the confidentiality and security of your information. We do not sell or rent your personal information to third parties for marketing purposes. Additionally, we may disclose personal information if required by law or to protect our rights and safety.</p><p><strong>Data Security</strong></p><p>We prioritize the security of your personal information and use industry-standard practices to protect it from unauthorized access, disclosure, alteration, or destruction. However, no method of transmission over the internet or electronic storage is 100% secure, and we cannot guarantee absolute security.</p><p>We prioritize the security of your personal information and use industry-standard practices to protect it from unauthorized access, disclosure, alteration, or destruction. We employ encryption, firewalls, access controls, and other security measures to safeguard your information. However, please be aware that no method of transmission over the internet or electronic storage is 100% secure, and we cannot guarantee absolute security. You are responsible for maintaining the confidentiality of your account credentials and for any activities that occur under your account.</p><p>We will retain your personal information for as long as necessary to fulfill the purposes outlined in this Privacy Policy, unless a longer retention period is required or permitted by law. When we no longer need to retain your information, we will securely delete or anonymize it.</p><p>We reserve the right to update or change our Privacy Policy at any time. Any changes will be effective immediately upon posting the revised Privacy Policy on this page. We encourage you to review this Privacy Policy periodically for any updates.</p>', NULL, NULL, 1, NULL, 1, '2023-10-10 22:02:57', '2024-03-11 23:04:06', NULL);
