(1, 'Fresh Capsicum', 'We are committed to sustainable farming practices, utilizing environmentally friendly methods to grow our capsicums, reducing carbon footprint.', '<p>Fresh Capsicum is a vibrant and nutritious vegetable that is loved by many for its crispness and versatility in cooking. Our green and fresh capsicums are carefully handpicked from the finest farms, ensuring the highest quality and freshness.<br><br>These capsicums are known for their vibrant green color, which indicates their freshness and ripeness. With their firm texture and refreshing taste, they add a delightful crunch to salads, stir-fries, and various culinary creations.&nbsp;<br><br>Our Fresh Capsicum is packed with essential vitamins and minerals, making it a great addition to a healthy diet. It is a rich source of Vitamin C, which helps boost the immune system and promotes healthy skin. Additionally, capsicums are low in calories and high in fiber, making them an excellent choice for weight-conscious individuals.<br><br>We take pride in delivering only the freshest capsicums to our customers. To ensure their optimal freshness, our capsicums are carefully inspected, sorted, and packed with great attention to detail. Our state-of-the-art facilities and stringent quality control procedures guarantee that each capsicum you receive meets our high standards.<br><br>Whether you are a professional chef or a home cook, our Fresh Capsicum is an essential ingredient that adds flavor, color, and nutrition to your culinary creations. With their crispness and vibrant green color, they not only enhance the visual appeal of your dishes but also provide a delightful burst of freshness in every bite.<br><br>Choose our Fresh Capsicum to elevate your cooking experience and enjoy the natural goodness it brings to your meals. Trust in our commitment to quality and freshness, and experience the difference that our green and fresh capsicums can make in your culinary endeavors.</p>', 'simple', '1 KG', 1000, 99, 4.00, 3.80, 5.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'VEG01', 0, 'in_stock', 'Farm-Fresh Green Capsicum', 'We are committed to sustainable farming practices, utilizing environmentally friendly methods to grow our capsicums, reducing carbon footprint.', 18, 8, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'fresh-capsicum', 1, 3, 1, 1, NULL, '2023-08-24 03:22:33', '2023-09-29 04:10:34'),
(2, 'Handpicked Tomatoes', 'From salads to sauces, our tomatoes can be used in various recipes, providing customers with a versatile ingredient for their culinary creations. We prioritize delivering tomatoes that are freshly harvested, ensuring customers receive the highest level of freshness and taste.', '<p>Our Fresh Tomato is a delicious and nutritious choice for those seeking a vibrant and healthy addition to their meals. Grown with utmost care and dedication, our tomatoes are hand-picked at the peak of ripeness to ensure optimal flavor and freshness.&nbsp;<br><br>With a beautiful green hue and a commitment to organic farming practices, our Fresh Tomato stands out for its exceptional quality. We take great pride in providing our customers with a product that not only tastes great but also supports a sustainable and environmentally friendly lifestyle.<br><br>Whether you\'re a professional chef looking to elevate your culinary creations or an everyday cook aiming to add a burst of freshness to your dishes, our Fresh Tomato is the perfect choice. Its firm texture and juicy flesh make it a versatile ingredient for a wide range of recipes, including salads, soups, sauces, and more.<br><br>What sets our tomatoes apart is the dedication and attention to detail that goes into their cultivation. Our farmers use only the purest and most effective organic farming methods, ensuring that no harmful chemicals or pesticides are used during the growing process. This results in a tomato that not only tastes better but also promotes a healthier lifestyle for you and your loved ones.<br><br>When you choose our Fresh Tomato, you\'re not only choosing a delicious and nutritious product, but you\'re also making a conscious decision to support sustainable and eco-friendly farming practices. We believe in providing food that is not only good for you but also good for the planet.<br><br>Experience the vibrant flavor and natural goodness of our Fresh Tomato today. With its green and organic qualities, it\'s a choice you can feel confident and proud of.</p>', 'simple', '2 KG', 2000, 49, 8.00, 8.00, 0.50, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'VEG02', 0, 'in_stock', 'Handpicked Tomatoes', 'From salads to sauces, our tomatoes can be used in various recipes, providing customers with a versatile ingredient for their culinary creations. We prioritize delivering tomatoes that are freshly harvested, ensuring customers receive the highest level of freshness and taste.', 42, 42, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'handpicked-tomatoes', 1, 3, 1, 1, NULL, '2023-08-24 03:37:01', '2023-09-29 04:10:34'),
(3, 'Deliciously Ripe Peach', 'Incorporate our Deliciously Ripe Peaches into your healthy lifestyle or relish them as an occasional indulgence. Whichever way you choose to enjoy them, be prepared for a symphony of flavors that celebrate the natural goodness of this summer fruit.', '<p>Immerse yourself in the quintessential essence of summer with our meticulously curated selection of handpicked peaches, sourced directly from sun-drenched orchards. Each peach undergoes a meticulous selection process, meticulously chosen at the zenith of its ripeness, guaranteeing an explosion of delectable juiciness and unparalleled sweetness in every single bite.</p><p>With a commitment to delivering an unrivalled sensory experience, our peaches are a testament to nature\'s perfection. The vibrant flavours and tantalising fragrances that emanate from each fruit transport you to the heart of the orchard, capturing the very essence of the sun-soaked season.</p><p>Indulge in the symphony of taste and aroma that only the freshest peaches can offer. Whether enjoyed on their own, incorporated into culinary creations, or savoured as a refreshing addition to beverages, our handpicked peaches stand as a celebration of the fleeting beauty and exquisite taste that define the peak of summer. Elevate your senses and embrace the unparalleled quality that our sun-kissed peaches bring to every table, every occasion, and every moment of enjoyment.</p>', 'simple', '3 KG', 3000, 54, 9.00, 8.55, 5.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FRUIT01', 0, 'in_stock', 'Deliciously Ripe Peach', 'Incorporate our Deliciously Ripe Peaches into your healthy lifestyle or relish them as an occasional indulgence. Whichever way you choose to enjoy them, be prepared for a symphony of flavors that celebrate the natural goodness of this summer fruit.', 35, 35, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'deliciously-ripe-peach', 1, 4, 1, 1, NULL, '2023-08-24 03:42:12', '2023-09-29 04:10:33'),
(4, 'Premium Organic Onion', 'Our premium organic onions are certified to be free from synthetic fertilizers, pesticides, and genetic modification, ensuring a healthier and safer choice for consumers.', '<p>This product is specially curated for those who seek the finest quality onions available in the market. Our Premium Organic Onion guarantees freshness and superior taste, making it an excellent choice for all your culinary endeavors.<br><br>Grown using organic farming methods, these onions are cultivated without the use of any synthetic fertilizers or harmful pesticides. We take pride in offering you a product that is not only delicious but also free from any harmful chemicals, ensuring the health and well-being of you and your loved ones.<br><br>Our Premium Organic Onion stands out from the rest due to its exceptional quality. Each onion is carefully handpicked and undergoes rigorous quality checks to ensure that only the best ones reach your kitchen. They are plump, firm, and boast a vibrant appearance that will enhance the visual appeal of your dishes.<br><br>When it comes to taste, our Premium Organic Onion truly shines. Its rich and robust flavor adds depth and complexity to any recipe, whether it\'s a hearty soup, a savory stir-fry, or a mouthwatering salad. The natural sweetness of our onions is balanced perfectly, making them a versatile ingredient that can elevate the taste of any dish.<br><br>You can trust our Premium Organic Onion to deliver consistent quality and extraordinary flavor every time. Whether you are a home cook or a professional chef, this product is a must-have in your kitchen. Its premium nature ensures that your culinary creations will be a cut above the rest.<br><br>Indulge in the goodness of our Premium Organic Onion and elevate your cooking to new heights. Experience the difference in taste and quality that only our carefully cultivated onions can provide. Trust us to deliver the best organic onions that will make your meals truly exceptional.</p>', 'simple', '3 KG', 3000, 55, 10.00, 9.90, 1.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'VEG03', 0, 'in_stock', 'Premium Organic Onion', 'Our premium organic onions are certified to be free from synthetic fertilizers, pesticides, and genetic modification, ensuring a healthier and safer choice for consumers.', 48, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'premium-organic-onion', 1, 3, 1, 1, NULL, '2023-08-24 03:53:16', '2023-08-25 03:30:29'),
(5, 'Superior Quality Amla', 'Nutrient-Rich Superfood: Amala is packed with essential nutrients, vitamins, and minerals, making it a highly nutritious addition to anyone\'s diet.', '<p>Experience wellness anew with Nature\'s Nectar Pure Organic Amala—an exquisite gift from nature that nurtures both body and soul. Imbued with the essence of traditional Ayurvedic wisdom, our carefully crafted Amala product offers an effortless way to embrace its benefits.</p><p>Amala, or Indian Gooseberry, revered for ages in Ayurveda, brings unparalleled nutritional value and potent antioxidants. Our Pure Organic Amala embodies the essence of this fruit, sourced from certified organic farms with utmost care to ensure purity. Meticulously harvested at its zenith, it retains its natural goodness through advanced processing, free from harmful additives.</p><p>Rich in Vitamin C, Nature\'s Nectar Pure Organic Amala boosts immunity, supports radiant skin, and vitality. Bioactive compounds like flavonoids and polyphenols further offer antioxidant, anti-inflammatory, and rejuvenating effects. Easily incorporate it into your daily routine—add to smoothies, craft revitalizing face masks, or enhance your favorite dishes with its tangy twist.</p><p>Committed to your well-being and the planet, Nature\'s Nectar champions sustainable practices, using eco-friendly packaging and supporting ethical farming. Begin your journey to optimal health with our Pure Organic Amala—where tradition meets science, offering you the best of nature in every serving.</p>', 'simple', '5 KG', 1500, 27, 7.00, 6.72, 4.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FRUIT02', 0, 'in_stock', 'Superior Quality Amla', 'Nutrient-Rich Superfood: Amala is packed with essential nutrients, vitamins, and minerals, making it a highly nutritious addition to anyone\'s diet.', 52, 52, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'superior-quality-amla', 1, 4, 1, 1, NULL, '2023-08-24 03:58:03', '2023-08-24 22:39:10'),
(6, 'Gourmet Organic Cabbage', 'Our gourmet organic cabbage is carefully cultivated to ensure the highest quality and freshness for our customers. Packed with essential vitamins and minerals, our organic cabbage offers a healthy addition to any diet.', '<p>Introducing our exceptional product, Gourmet Organic Cabbage, the epitome of premium and freshness. This delectable cabbage is meticulously cultivated using organic farming practices, ensuring the highest quality and taste.&nbsp;<br><br>Our Gourmet Organic Cabbage stands out from the rest, as it is carefully hand-picked at the perfect stage of maturity, guaranteeing optimal flavor and texture. Its vibrant green leaves and crispness are a testament to its freshness, making it ideal for both cooking enthusiasts and health-conscious individuals.<br><br>Whether you are a home cook, a professional chef, or simply someone who appreciates the finer things in life, our Gourmet Organic Cabbage will elevate your culinary creations. Its versatility allows for a wide range of cooking methods, from sautéing and stir-frying to steaming and braising, offering endless possibilities for flavorful dishes.<br><br>Not only does our Gourmet Organic Cabbage elevate your cooking experience, but it also supports a sustainable and eco-friendly lifestyle. By choosing organic produce, you contribute to the preservation of the environment and the health of future generations.<br><br>Indulge in the premium quality and freshness of our Gourmet Organic Cabbage, and experience the difference it brings to your meals. Elevate your culinary creations to new heights with this exceptional product.</p>', 'simple', '1 KG', 1000, 59, 3.00, 3.00, NULL, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'VEG04', 1, 'in_stock', 'Gourmet Organic Cabbage', 'Our gourmet organic cabbage is carefully cultivated to ensure the highest quality and freshness for our customers. Packed with essential vitamins and minerals, our organic cabbage offers a healthy addition to any diet.', 14, 14, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'gourmet-organic-cabbage', 1, 3, 1, 1, NULL, '2023-08-24 03:59:22', '2023-09-29 04:10:34'),
