(10, 'Juicy Green Kiwi', 'Great Taste: Our Kiwi is incredibly delicious, with a perfect balance of sweetness and tanginess that will leave your taste buds craving for more.', '<p>Discover the exquisite world of flavour and health with our premium fresh kiwi selection. These emerald gems are a true delight for your senses, offering a unique combination of sweet and tart notes that invigorate your palate. Here\'s why our fresh kiwis stand out:</p><ul><li><strong>Unrivalled Quality:</strong> We pride ourselves on delivering Kiwi of unparalleled quality. Each kiwi is carefully handpicked from select orchards, ensuring that you receive only the finest fruits that meet our strict standards of ripeness, colour, and texture.</li><li><strong>Nutrient Powerhouse:</strong> Bursting with essential nutrients, kiwis are a nutritional powerhouse. They\'re renowned for their exceptional vitamin C content, which supports your immune system, skin health, and overall well-being. Additionally, kiwis are rich in dietary fibre, potassium, and antioxidants.</li><li><strong>Sensational Taste:</strong> Our fresh kiwis offer a harmonious blend of sweetness and tanginess. Their vibrant green flesh is a testament to their freshness, and their distinct flavour profile makes them an exciting addition to your culinary adventures.</li><li><strong>Versatile Culinary Delight:</strong> From enjoying them on their own to adding them to fruit salads, yoghurt bowls, and smoothies, fresh kiwis add a burst of colour and flavour to your dishes. Their unique taste elevates both sweet and savoury recipes, making them a must-have ingredient in your kitchen.</li><li><strong>Gorgeous Presentation:</strong> The striking appearance of sliced kiwi, with its tiny black seeds and vibrant green hue, adds a touch of elegance to any dish. Whether used as a garnish or a central ingredient, fresh kiwis enhance the visual appeal of your creations.</li><li><strong>Wholesome Snacking:</strong> With their convenient size and