order in advance to secure your supply of our Freshly Picked Durian. Enjoy the taste of luxury with each bite of our premium durian.</p>', 'simple', '2 KG', 2000, 75, 5.50, 5.23, 5.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'VEG09', 0, 'in_stock', 'Freshly Picked Durian', 'Bursting with vitamins and minerals, our Freshly Picked Durian provides a healthy and nutritious snack option for those conscious about their well-being.', 25, 25, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'freshly-picked-durian', 1, 3, 1, 1, NULL, '2023-08-24 04:45:47', '2023-08-25 03:27:47'),
(15, 'Premium Organic Pumpkin', 'Our Premium Organic Pumpkin has received glowing reviews from satisfied customers, highlighting its taste, quality, and health benefits.', '<p>In the realm of health-conscious living, discerning individuals seek not just products, but experiences that align with their dedication to well-being. One such product that stands as the epitome of quality and taste is our Premium Organic Pumpkin. It is meticulously crafted, keeping in mind the preferences of those who prioritize both health and indulgence. This product has not only set a benchmark in quality but has also garnered a vast community of satisfied customers who swear by its undeniable excellence.</p><p>The cornerstone of our Premium Organic Pumpkin lies in its sourcing—carefully handpicked from the finest organic farms. Cultivated without the use of harmful pesticides or synthetic fertilizers, our pumpkins embody the essence of purity and nutritional value. Each pumpkin is meticulously chosen at the pinnacle of its ripeness, ensuring a flavour that is not only delectable but also tantalizing to the taste buds.</p><p>Beyond being a culinary delight, our Premium Organic Pumpkin offers a treasure trove of health benefits. Bursting with essential vitamins, minerals, and antioxidants, it stands as a strong pillar supporting a robust immune system, aiding digestion, and promoting overall well-being. Moreover, being naturally low in calories and high in fiber, it\'s a perfect fit for a balanced diet, complementing your journey towards a healthier you.</p><p>The versatility of our Premium Organic Pumpkin knows no bounds. Whether you\'re a professional chef or an enthusiastic home cook, this product is poised to elevate your culinary creations. From creamy pumpkin soups that warm the soul to mouth-watering pies that delight the senses, its potential in the kitchen is truly exceptional. Get ready to surprise and impress your friends and family with dishes that not only taste incredible but