(16, 'Fresh Pear', 'They have been linked to a number of health benefits, including improved digestion, heart health, and blood sugar control.', '<p>Pears are a delicious and nutritious fruit that is enjoyed by people all over the world. They are a good source of fiber, potassium, vitamin C, and other vitamins and minerals. Pears are also a low-calorie food, making them a healthy choice for people who are watching their weight.</p><p>There are many different varieties of pears, each with its own unique flavor and texture. Some of the most popular varieties include Bartlett pears, Bosc pears, and Anjou pears. Bartlett pears are the most common variety and have a sweet, juicy flesh. Bosc pears are slightly tart and have a firm texture. Anjou pears are also sweet, but they have a more delicate flesh.</p><p>Fresh pears are best eaten when they are ripe. Ripe pears will be soft to the touch and will have a sweet aroma. To ripen pears at home, place them in a paper bag with an apple or banana. The ethylene gas released by the apple or banana will help the pears ripen more quickly.</p><p>Once pears are ripe, they can be eaten fresh, cooked, or used in a variety of recipes. Fresh pears are a delicious and healthy snack or dessert. They can also be used in salads, pies, and other desserts. Pears can also be cooked, either poached, baked, or grilled.</p><p>When choosing fresh pears, look for fruits that are free of bruises and blemishes. Pears should also be firm to the touch. Avoid pears that are soft or mushy, as these are likely overripe.</p>', 'simple', '3 KG', 3000, 38, 6.00, 5.70, 5.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, 'fixed', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FRUIT06', 0, 'in_stock', 'Fresh Pear', 'They have been linked to a number of health benefits, including improved digestion, heart health, and blood sugar control.', 83, 83, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'fresh-pear', 1, 4, 1, 1, NULL, '2023-08-24 05:02:27', '2024-03-13 21:42:38'),
