(19, 'Deliciously Sweet Strawberry', 'Premium Quality: Our strawberries are carefully selected for their exceptional taste and freshness, ensuring a premium quality product that sets us apart from the competition.', '<p>Introducing an exquisite culinary delight: our mouthwatering strawberries. Elevating the art of gastronomy, these luscious red berries are poised to captivate your senses and elevate your dining experiences. With a symphony of flavours that harmoniously combine natural sweetness and tangy undertones, our strawberries are a true gem in the realm of fruits.</p><p>Handpicked with meticulous care, our strawberries are cultivated to perfection, ensuring each berry embodies the pinnacle of quality and taste. Our commitment to excellence drives us to select these treasures at the very zenith of their ripeness, guaranteeing that every bite is an indulgence in pure flavour.</p><p>Visually arresting with their vibrant hue and fragrant aroma, our strawberries are more than a fruit; they\'re a sensory experience. From standalone enjoyment to fusion into gourmet dishes and desserts, these berries serve as a transformative ingredient, turning every culinary endeavour into a masterpiece.</p><p>Delve into a multisensory journey as our strawberries offer a juicy, melt-in-your-mouth texture that releases an explosion of flavors. This burst of taste is not only a delight to your palate but also a testament to the natural goodness encapsulated within each berry. Rich in antioxidants that combat free radicals, a potent source of vitamin C vital for immune support, and a spectrum of essential nutrients, our strawberries epitomise the harmony between gourmet pleasure and healthful nourishment.</p><p>With an unrelenting focus on quality, our strawberries are grown in an environment that fosters their optimal development. The result is a product that speaks for itself—a manifestation of dedication and passion that transcends mere fruit. Your choice to indulge in our strawberries is an affirmation of your discerning taste and commitment to exceptional culinary encounters.</p><p>Elevate your moments with the epitome of strawberries. Elevate everyday snacks, transcend your dessert presentations, or craft unforgettable gift baskets brimming with these sumptuous berries. The possibilities are as endless as the taste they bring to your table.</p><p>Embark on a culinary odyssey with our professionally grown strawberries. Your journey begins with an order—a step towards a world where taste knows no bounds. As you relish the pure delight within each berry, you\'ll find yourself irresistibly drawn back to the unparalleled experience only our strawberries can provide.</p>', 'simple', '4 KG', 1700, 6, 7.00, 6.37, 9.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, '2023-9-23', '2023-10-24', 'FRUIT09', 0, 'in_stock', 'Deliciously Sweet Strawberry', 'Premium Quality: Our strawberries are carefully selected for their exceptional taste and freshness, ensuring a premium quality product that sets us apart from the competition.', 93, 93, NULL, NULL, NULL, 0, 1, 1, 1, 1, 'deliciously-sweet-strawberry', 1, 4, 1, 1, NULL, '2023-08-24 19:42:48', '2024-04-20 01:54:00');
