wellness.</p>', 'simple', '5 KG', 1000, 11, 5.00, 4.65, 7.00, 0, 0, 0, NULL, 'physical', 0, NULL, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FRUIT10', 0, 'in_stock', 'Gourmet Fresh Pomegranate', 'Naturally sweet and juicy: Each pomegranate offers a burst of sweet and refreshing flavor, making it a delightful snack or a perfect addition to refreshing beverages.', 90, 89, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'gourmet-fresh-pomegranate', 1, 4, 1, 1, NULL, '2023-08-24 20:02:12', '2024-04-20 01:54:00'),
(21, 'Probiotic Rich Yogurt', 'Packed with live and active cultures, our yogurt promotes a healthy gut and supports a strong immune system, making it an excellent choice for health-conscious individuals.', '<p>Introducing our Probiotic Rich Yogurt, the perfect choice for those seeking a fresh and healthy addition to their daily routine. Packed with beneficial live cultures, this yogurt not only satisfies your taste buds but also supports your digestive health. Our carefully crafted recipe ensures a creamy and delightful texture that will leave you longing for the next spoonful.<br><br>Indulge in the goodness of our probiotic-rich yogurt, as it nourishes your body with essential nutrients and promotes a well-balanced gut. With every bite, you can feel confident that you are making a conscious choice towards improving your overall well-being.<br><br>Made with love and expertise, our yogurt is produced with the highest quality standards, ensuring that you receive nothing short of perfection with every purchase. Delight in the harmonious blend of flavors and the smoothness that our probiotic-rich yogurt offers, making it an irresistible treat for any time of the day.<br><br>Whether you enjoy it plain or prefer to enhance it with your favorite fruits or granola, our probiotic-rich yogurt will undoubtedly become your go-to choice. Take the first step towards a healthier lifestyle and experience the power of probiotics with our exceptional product. Treat yourself to a delightful journey of taste and wellness with our probiotic-rich yogurt today!</p>', 'simple', '10 Pieces', 100, 5, 4.00, 3.68, 8.00, 0, 0, 0, NULL, 'physical', 0, NULL, 11, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'GROC01', 0, 'in_stock', 'Probiotic Rich Yogurt', 'Packed with live and active cultures, our yogurt promotes a healthy gut and supports a strong immune system, making it an excellent choice for health-conscious individuals.', 146, 146, NULL, NULL,