(22, 'Delicious Cupcakes', 'The perfect treat for any occasion. They\'re small and easy to share, and they come in a variety of flavors to satisfy everyone\'s taste buds.', '<p>Cupcakes are the perfect dessert for any occasion. They\'re small and dainty, so they\'re perfect for parties and gatherings. They\'re also easy to customize, so you can find the perfect flavor and decoration for everyone.</p><p>Our cupcakes are made with the finest ingredients, and they\'re baked fresh to order. We offer a wide variety of flavors, so you\'re sure to find something you love. Whether you\'re in the mood for chocolate, vanilla, or something more adventurous, we have you covered.</p><p>We also offer a variety of frostings and toppings, so you can really customize your cupcakes. Choose from classic buttercream, chocolate ganache, or something more unique like lemon curd or raspberry coulis.</p><p>Our cupcakes are sure to impress your guests. They\'re the perfect way to celebrate any occasion, big or small.</p>', 'simple', '3 Pieces', 250, 59, 5.00, 4.70, 6.00, 0, 0, 0, NULL, 'physical', 0, NULL, 11, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'GROC02', 0, 'in_stock', 'Delicious Cupcakes', 'The perfect treat for any occasion. They\'re small and easy to share, and they come in a variety of flavors to satisfy everyone\'s taste buds.', 151, 151, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'delicious-cupcakes', 1, 2, 1, 1, NULL, '2023-08-25 04:01:12', '2023-09-29 04:10:34'),
