ubes', 'Paneer is a great source of protein, making our gourmet cubes an ideal choice for health-conscious customers looking to maintain a balanced diet.', 162, 162, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'gourmet-paneer-cubes', 1, 2, 1, 1, NULL, '2023-08-25 04:10:34', '2023-08-25 04:15:07'),
