ing space.</p><p>So, why wait? Your home is a reflection of who you are, and it deserves the best. It deserves the elegance and sophistication that only Trendy Home Decor can provide. It\'s time to let your home speak volumes about your refined taste. It\'s time to transform your living space into a sanctuary of style and comfort. It\'s time to invest in elegance. It\'s time to invest in Trendy Home Decor.</p>', 'simple', '1 Item', 500, 25, 25.00, 22.50, 10.00, 0, 0, 0, NULL, 'physical', 0, NULL, 18, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FURN04', 0, 'in_stock', 'Trendy Home Decor', 'With our extensive collection of home decor items, customers have a vast selection to choose from, allowing them to find the perfect pieces that suit their style and preferences.', 444, 444, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'trendy-home-decor', 1, 7, 1, 1, NULL, '2023-09-01 03:28:00', '2023-09-29 21:53:13'),
