ng experience. You\'re immersing yourself in the seamless blend of functionality, elegance, and sustainability that only our product can offer. So why wait? Order now and let this perfect synergy of nature and craftsmanship enhance your everyday life.</p>', 'simple', '1 Item', 110, 23, 8.00, 7.84, 2.00, 0, 0, 0, NULL, 'physical', 0, NULL, 18, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FURN19', 0, 'in_stock', 'Organic Wood Dish', 'Made from sustainable wood sources, our dish is a perfect choice for environmentally conscious consumers.', 763, 763, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'organic-wood-dish', 1, 7, 1, 1, NULL, '2023-09-05 04:43:45', '2023-09-05 04:43:45');
