cious commodity in any home, and our Dining Table recognizes that. Its generous surface area provides ample room for your culinary creations and more. There\'s no need to juggle plates or worry about crowded spaces. Whether you\'re setting an elaborate dinner table with all the trimmings or enjoying a simple breakfast, this table accommodates it all. It\'s not just a piece of furniture; it\'s a facilitator of memorable experiences.</p>', 'simple', '1 Item', 4700, 28, 40.00, 30.40, 24.00, 0, 0, 0, NULL, 'physical', 0, NULL, 18, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'FURN20', 0, 'in_stock', 'Elegant Dining Table', 'The versatile design of our dining table allows it to seamlessly blend with various interior styles, making it a perfect addition to any home or office space.', 768, 768, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'elegant-dining-table', 1, 7, 1, 1, NULL, '2023-09-05 04:50:43', '2023-09-05 04:50:43'),
(106, 'Beige Compact Powder', 'Whether you prefer light or full coverage, our compact powder can be layered to suit your desired level of perfection, ensuring a flawless appearance.', '<p>Our Beige Compact Powder, the ultimate addition to your daily makeup regimen! Crafted with precision and professionalism, this compact powder promises to deliver a flawless finish that will leave you feeling confident and prepared to conquer whatever the day has in store for you.</p><p>Our Beige Compact Powder has been meticulously formulated with top-tier ingredients to guarantee long-lasting and natural-looking coverage. Its feather-light texture seamlessly melds with your skin, effectively diminishing the visibility of pores and blemishes. Whether your schedule calls for a day at the office or a special occasion, our compact powder stands ready to be your trusted companion, ensuring a polished and sophisticated appearance.</p><p>Its sleek and compact design allows for effortless portability, fitting snugly in your purse or makeup bag. This means that quick touch-ups are at your fingertips, no matter where you find yourself. Bid farewell to unsightly shine, and say hello to a radiant matte complexion that maintains its brilliance throughout the day.</p><p>Our Beige Compact Powder is compatible with all skin types, having undergone rigorous dermatological testing to ensure its safety and suitability for all. It\'s also devoid of harmful chemicals, granting your skin a gentle and nurturing experience.</p><p>Unleash your inherent beauty with the assistance of our Beige Compact Powder, and be prepared for the confidence boost you truly deserve. Showcase a radiant complexion that will captivate attention and prompt compliments wherever you go. This indispensable beauty accessory is an opportunity you wouldn\'t want to pass up. Secure your order today and take your makeup game to the next level with our Beige Compact Powder!</p><p>---</p><p>In the realm of cosmetics, few products can claim the versatility and transformative potential of a high-quality compact powder. Our Beige Compact Powder is no exception, and it\'s poised to become your trusty sidekick in the world of makeup.</p><p>Imagine a product that effortlessly camouflages imperfections, minimizes the appearance of pores, and imparts a matte finish that lasts from sunrise to sunset. This is precisely what our Beige Compact Powder brings to the table. Designed with professionalism and precision, this makeup essential is your ticket to achieving a flawless, radiant complexion.</p><p>At the core of our Beige Compact Powder is a carefully curated blend of ingredients that have been selected to meet the highest standards of quality. This formulation guarantees not only exceptional coverage but also a natural look that won\'t appear caked-on or heavy. Your skin will thank you for the lightweight touch.</p><p>One of the standout features of this product is its adaptability. Whether you\'re heading to work, preparing for a formal event, or simply running errands, our compact powder has your back. It\'s a versatile tool that seamlessly integrates into your routine, ensuring you always look your best, no matter the occasion.</p><p>Convenience is another key aspect of our Beige Compact Powder. Its elegant and compact design allows it to slip into your handbag or makeup kit effortlessly. This means you can have it on hand for quick touch-ups whenever and wherever you please. No more worrying about mid-day shine or makeup meltdowns. With our compact powder, your matte finish remains intact.</p><p>Concerned about compatibility with your skin type? Worry not. Our Beige Compact Powder has undergone rigorous dermatological testing to ensure it suits all skin types, even the most sensitive. Furthermore, it\'s free from harmful chemicals, ensuring a safe and nurturing experience for your skin.</p><p>It\'s not just about makeup; it\'s about the confidence that comes with knowing you look your best. Our Beige Compact Powder is designed to enhance your natural beauty, empowering you to make a statement wherever you go. With a radiant complexion that turns heads and garners compliments, you\'ll feel ready to take on the world.</p><p>Don\'t miss out on this must-have beauty essential. Secure your order today and step up your makeup game with our Beige Compact Powder!</p>', 'simple', '1 Item', 200, 48, 40.00, 32.00, 20.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'BEAU01', 0, 'in_stock', 'Beige Compact Powder', 'Whether you prefer light or full coverage, our compact powder can be layered to suit your desired level of perfection, ensuring a flawless appearance.', 860, 860, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'beige-compact-powder', 1, 12, 1, 1, NULL, '2023-09-07 00:48:28', '2023-09-07 00:48:43'),
(107, 'Advanced Formula Concealer', 'Achieve a professional-looking finish with our advanced formula concealer, providing excellent coverage for any skin imperfections.', '<p>Our Advanced Formula Concealer is a beauty game-changer, and it\'s here to revolutionize your daily routine. Whether you\'re a makeup aficionado or someone who likes to keep it simple, this concealer is designed to cater to all skin types and bring out the best in your complexion.</p><p>Let\'s dive into what makes this concealer a must-have addition to your makeup arsenal. At its core, this professional-grade formula is expertly crafted to provide exceptional coverage. It\'s like your secret weapon against imperfections, blemishes, and those pesky dark circles that seem to appear out of nowhere. With just a few strokes of this concealer, you can bid adieu to these nuisances and say hello to a flawless finish that lasts all day.</p><p>One of the standout features of our Advanced Formula Concealer is its ability to effortlessly blend into your skin. No more worrying about that noticeable line where your concealer ends and your skin begins. This concealer seamlessly merges with your skin, leaving behind a natural, undetectable finish. You\'ll look like you woke up with flawless skin, and we promise not to spill your beauty secret.</p><p>The struggle to find the perfect shade is real, but not with our concealer. We\'ve meticulously formulated it to match a wide range of skin tones. Whether you have fair porcelain skin or a rich, deep complexion, our concealer has got you covered. Literally. It adapts to your unique shade with ease, making it accessible to everyone.</p><p>But here\'s where our concealer truly shines (pun intended). It\'s not just about concealing; it\'s also about caring for your skin. Enriched with skin-loving ingredients, this formula hydrates and moisturizes your skin as you wear it. You can consider it a fusion of skincare and makeup in one product. Say goodbye to that dry, cakey feeling that some concealers leave behind. Our concealer leaves your skin feeling soft, supple, and rejuvenated.</p><p>Now, let\'s talk about versatility. Our concealer offers buildable coverage, which means you\'re in control. Whether you prefer a light touch-up for those casual outings or full coverage for special occasions, our concealer has your back. It\'s lightweight, so it won\'t weigh you down, but it will still give you the coverage you desire.</p><p>The transformative power of our Advanced Formula Concealer has already won over countless satisfied customers. It\'s not just makeup; it\'s confidence in a tube. You\'ll see the difference it makes in enhancing your natural beauty, and that boost in confidence is priceless. It\'s perfect for daily use to keep you looking fresh and radiant, and it\'s equally exceptional for those special moments when you want to shine.</p><p>So, why wait to experience the magic? Our Advanced Formula Concealer is waiting for you, ready to unlock the secret to radiant, flawless skin. Join the ranks of those who have already discovered its wonders. Order now and get ready to transform your beauty routine with this incredible concealer. You deserve nothing less than a flawless complexion, and now, achieving it is just a few clicks away.</p>', 'simple', '1 Item', 140, 49, 30.00, 24.00, 20.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'BEAU02', 0, 'in_stock', 'Advanced Formula Concealer', 'Achieve a professional-looking finish with our advanced formula concealer, providing excellent coverage for any skin imperfections.', 878, 878, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'advanced-formula-concealer', 1, 12, 1, 1, NULL, '2023-09-07 00:48:51', '2023-09-07 00:49:01'),
(108, 'Back to Basics Eyeshadow Palette', 'Each eyeshadow in our palette is formulated with intense pigmentation, providing professional-grade color payoff that lasts all day.', '<p>The Back to Basics Eyeshadow Palette is more than just a makeup product; it\'s a gateway to effortless and stunning eye looks that can transform your entire appearance. With a meticulously crafted selection of shades that cater to every occasion and style, this palette embodies the essence of versatility and timeless beauty.</p><p>This professional-grade eyeshadow palette is a treasure trove for those who want to indulge in the artistry of eyeshadow application. Its carefully curated shades span the spectrum, offering a harmonious fusion of matte, shimmer, and satin finishes. Whether you\'re aiming for a soft, natural look or a sultry, smoky allure, the Back to Basics Eyeshadow Palette opens up a world of possibilities to enhance your natural beauty.</p><p>One of the standout features of this palette is the exceptional quality of each shade. They\'re formulated with high-quality ingredients, ensuring superior pigmentation and long-lasting wear. The result? Captivating color that stays put throughout the day or night. Whether you\'re headed to a long day at the office or a glamorous night out, your eye makeup will remain flawless.</p><p>The velvety texture of these eyeshadows makes application a breeze. They blend seamlessly, allowing you to create intricate eye looks with ease. Whether you\'re a seasoned makeup pro or just beginning your makeup journey, you\'ll find that this palette is your reliable companion. Its versatility means you can experiment with different looks, from subtle day-to-day styles to bold, evening glam.</p><p>The Back to Basics Eyeshadow Palette is designed to cater to both makeup enthusiasts and professionals alike. Its sleek and durable packaging ensures that it can withstand the rigors of travel and on-the-go touch-ups. Whether you\'re jet-setting around the world or simply need to refresh your look during a busy day, this palette\'s got your back.</p><p>But what truly sets this palette apart is its ability to unlock your inner artist. It empowers you to experiment and elevate your eye makeup game. The timeless beauty of neutral shades is at your fingertips, allowing you to create captivating looks that turn heads wherever you go. Whether you\'re enhancing your everyday makeup routine or preparing for a special occasion, the Back to Basics Eyeshadow Palette is a must-have, an essential companion for any beauty aficionado.</p><p>In a world of endless makeup choices, the Back to Basics Eyeshadow Palette stands out as a versatile and indispensable tool. Its carefully curated shades, spanning the spectrum from soft neutrals to smoky hues, offer endless possibilities for eye looks that complement your unique style. With its superior pigmentation, long-lasting wear, and seamless blending, this palette provides a canvas for your creativity. It\'s not just makeup; it\'s an invitation to explore, express, and enhance your natural beauty.</p><p>The palette\'s formulation is a testament to its quality. Each shade is created with precision, using high-quality ingredients that ensure vibrant color payoff. When you dip your brush into these eyeshadows, you\'ll experience the smoothness of the application, the intensity of the pigments, and the longevity of the wear. Whether you\'re attending a busy day of meetings or dancing the night away at a special event, your eye makeup will remain flawless.</p><p>Versatility is the cornerstone of the Back to Basics Eyeshadow Palette. Its combination of matte, shimmer, and satin finishes allows you to transition seamlessly from day to night, from subtle to bold. It\'s your trusty companion for every occasion, from casual outings to glamorous soirées. With this palette, you\'re in control of your look, and the possibilities are limited only by your imagination.</p><p>The velvety texture of these eyeshadows makes them a joy to work with. They glide on effortlessly, allowing you to blend and build with ease. Whether you\'re a seasoned makeup artist or a beginner exploring the world of cosmetics, you\'ll appreciate the user-friendly nature of this palette. It encourages experimentation and creativity, inviting you to explore different combinations and styles.</p><p>The Back to Basics Eyeshadow Palette isn\'t just a makeup product; it\'s an essential part of your beauty routine. Its sleek and durable packaging ensures that it can keep up with your busy life. Toss it into your bag for quick touch-ups or take it along on your travels; it\'s designed to be your reliable companion. No matter where life takes you, this palette ensures that you\'re always ready to put your best face forward.</p><p>But perhaps the most captivating aspect of this palette is its ability to unlock your inner artist. It encourages you to step out of your comfort zone, try new looks, and express your individuality. The neutral shades are like a blank canvas, waiting for your creativity to paint a masterpiece. Whether you\'re accentuating your eyes for a special occasion or simply enhancing your everyday look, this palette empowers you to explore and experiment.</p><p>Fashion and beauty are ever-evolving, and makeup is a powerful tool for self-expression. The Back to Basics Eyeshadow Palette understands this dynamic, offering you a wide range of shades that adapt to your style and mood. It allows you to express your uniqueness through colour and creativity. As you explore the world of eyeshadow artistry with this palette, you\'ll discover that makeup is more than a product; it\'s a means of telling your story, celebrating your individuality, and enhancing your natural beauty.</p><p>In conclusion, the Back to Basics Eyeshadow Palette is not just a makeup product; it\'s a gateway to self-expression and confidence. Its carefully selected shades, exceptional quality, and user-friendly nature make it an indispensable tool in your beauty arsenal. With this palette, you\'re not just applying makeup; you\'re crafting art. So, embrace the timeless allure of neutral shades and let your creativity flow. Whether you\'re heading to work, attending a special event, or simply expressing yourself, this palette is your companion on the journey to stunning and effortless eye looks.</p>', 'simple', '1 Item', 200, 200, 50.00, 40.00, 20.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'BEAU03', 0, 'in_stock', 'Back to Basics Eyeshadow Palette', 'Each eyeshadow in our palette is formulated with intense pigmentation, providing professional-grade color payoff that lasts all day.', 882, 882, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'back-to-basics-eyeshadow-palette', 1, 12, 1, 1, NULL, '2023-09-07 00:55:37', '2023-09-07 00:55:37'),
(109, 'Liquid Eyeliner', 'Our liquid eyeliner is designed to stay put all day, ensuring your customers\' eyes stay beautifully defined from morning to night.', '<p>In the world of makeup, precision is paramount. It\'s the delicate strokes of a brush or pencil that can transform a look from ordinary to extraordinary. And when it comes to enhancing the windows to your soul, nothing quite compares to the finesse and versatility of a high-quality liquid eyeliner.</p><p><strong>A Professional-Grade Marvel</strong></p><p>At the heart of our cosmetic offerings lies our liquid eyeliner, a true masterpiece designed to elevate your eye makeup routine. It caters to both makeup enthusiasts and seasoned professionals, promising a world of precision and elegance.</p><p><strong>The Art of Crafting Perfection</strong></p><p>Behind the scenes, our liquid eyeliner is meticulously crafted with the utmost care. Its formula is a testament to our commitment to excellence—a blend that ensures a smooth and sleek application. This liquid eyeliner glides effortlessly across your eyelids, delivering remarkable precision with each stroke. Whether you\'re aiming for a classic, razor-thin line or a bold, dramatic wing, this eyeliner adapts to your creativity with unparalleled versatility.</p><p><strong>Longevity Meets Beauty</strong></p><p>One of the hallmarks of a superior liquid eyeliner is its ability to stay put, regardless of the challenges of the day. Our liquid eyeliner is no exception. It resists smudging, fading, and flaking, ensuring that your meticulously crafted lines remain pristine from the early hours of the morning to the late hours of the night. This isn\'t just makeup; it\'s a steadfast companion for your daily adventures.</p><p><strong>Quick-Drying Magic</strong></p><p>In the fast-paced world we live in, every second counts. Our liquid eyeliner boasts a quick-drying formula that lets you achieve a flawless finish in mere seconds. No more waiting around for your eyeliner to set; with this product, you\'re in control of your time and your look.</p><p><strong>Kind to Your Skin</strong></p><p>Your eyes are precious, and the skin around them deserves the utmost care. Our liquid eyeliner is meticulously formulated with your skin in mind. It\'s free from harsh chemicals and irritants, making it suitable for all skin types, including those with sensitive eyes. Confidence is beautiful, and our eyeliner ensures that you can wear it without worry.</p><p><strong>Designed for Your Convenience</strong></p><p>Makeup is an art form, and like any artist, you need the right tools. Our liquid eyeliner is not only a masterstroke in formulation but also in design. Its sleek and compact packaging makes it a convenient addition to your makeup bag or purse. This means you can effortlessly carry it with you for quick touch-ups on the go. The fine-tip applicator ensures precision with every use, putting you in full control of your desired look.</p><p><strong>The Ultimate Transformation</strong></p><p>Your eyes are your canvas, and our liquid eyeliner is your brush. It\'s the perfect tool to achieve professional-looking results. Whether you want to make a subtle statement or captivate the room with a bold, dramatic gaze, our liquid eyeliner empowers you to do so with confidence and ease.</p><p><strong>A Lasting Impression</strong></p><p>In a world filled with countless distractions, it\'s essential to leave a lasting impression. With our liquid eyeliner, you can be confident that your eyes will be the focal point of every interaction. Stand out from the crowd with defined eyes that command attention and convey your unique style.</p><p><strong>Conclusion:</strong><br>In the grand tapestry of makeup, liquid eyeliner stands as a beacon of precision and elegance. It\'s not just cosmetic; it\'s a tool that empowers you to express yourself with confidence. The journey to flawless eye makeup begins here, with a product crafted with care, designed for convenience, and capable of creating mesmerizing looks that leave an indelible mark. So why wait? Add our liquid eyeliner to your cart now and experience the difference for yourself. Elevate your eye makeup game, one stroke at a time.</p>', 'simple', '1 Item', 120, 290, 45.00, 31.50, 30.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'BEAU04', 0, 'in_stock', 'Liquid Eyeliner', 'Our liquid eyeliner is designed to stay put all day, ensuring your customers\' eyes stay beautifully defined from morning to night.', 885, 885, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'liquid-eyeliner', 1, 12, 1, 1, NULL, '2023-09-07 01:27:44', '2023-09-07 01:27:44'),
(110, 'Perfecting Liquid Foundation', 'Our Perfecting Liquid Foundation offers impeccable coverage, concealing any imperfections on the skin for a flawless complexion.', '<p>A game-changer in the realm of beauty that promises to elevate your makeup game and leave you with a complexion that will truly captivate. This extraordinary product is meticulously crafted to meet all your makeup needs, ensuring a flawlessly radiant finish that will have everyone around you in awe.</p><p>At the heart of our Perfecting Liquid Foundation lies a professional-grade formula, carefully curated with the highest quality ingredients. The result? A smooth, even application that you can rely on, every single time you use it. This foundation boasts a lightweight texture and customizable coverage, granting you the power to effortlessly achieve your desired look, whether it\'s a natural, understated finish or a more glamorous, statement-making appearance.</p><p>Bid farewell to imperfections, as this foundation is your ticket to a flawless canvas. It expertly conceals blemishes, fine lines, and uneven skin tones, leaving you with a picture-perfect complexion that will elevate your confidence to new heights. What\'s more, its long-lasting formula ensures that your impeccable look lasts throughout the day, requiring no inconvenient touch-ups.</p><p>But our Perfecting Liquid Foundation isn\'t just about surface beauty. It\'s a product that cares for your skin while it enhances it. Enriched with an array of skin-loving vitamins and antioxidants, it goes beyond makeup, acting as a nourishing skincare product. Your skin will feel rejuvenated and refreshed, thanks to this foundation\'s hydrating properties. Moreover, the lightweight nature of the formula allows your skin to breathe, effectively preventing clogged pores and unsightly breakouts.</p><p>One of the standout features of our Perfecting Liquid Foundation is its versatility. It caters to all skin types, whether you\'re dealing with dry, oily