ts', 'Our treats are made from all-natural ingredients, free from any artificial additives or preservatives, making them a healthier choice for your pets.', 900, 900, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'pet-treats', 1, 6, 1, 1, NULL, '2023-09-07 20:43:12', '2023-09-07 20:43:12'),
(112, 'Matte Lipstick', 'Our matte lipstick is designed to be smudge-proof and transfer-resistant, ensuring that your vibrant lip color stays intact without any mess.', '<p>It\'s not just any lipstick; it\'s a professional-grade wonder that can redefine your makeup game. The allure of matte lips is undeniable, and our Matte Lipstick is here to make sure you achieve that stunning matte finish with ease.</p><p>Imagine a lipstick that\'s not just about the color but also about the experience. That\'s precisely what our Matte Lipstick offers. Its high-quality formula is designed to glide smoothly onto your lips, giving you a luscious and long-lasting colour. No more frequent touch-ups or worrying about your lipstick fading away. With this lipstick, your pout remains on point throughout the day or night.</p><p>One of the defining features of our Matte Lipstick is its versatility. It\'s a product crafted with the modern woman in mind, someone who\'s constantly on the move and needs makeup that can keep up. Whether you\'re heading to the office or stepping out for a night on the town, this lipstick has you covered. Its velvety texture not only ensures comfortable wear but also helps you maintain that polished look no matter what\'s on your agenda. And here\'s the best part – it won\'t dry out your lips or cause any discomfort.</p><p>Now, let\'s talk about choices. We understand that variety is key when it comes to makeup, and our Matte Lipstick offers a wide range of vibrant and sophisticated shades to choose from. This means that, whether you\'re feeling chic and understated or bold and glamorous, you can effortlessly match your lipstick to your mood or outfit. From classic nudes that exude elegance to fiery reds that make a statement, our Matte Lipstick gives you endless possibilities to express your unique style and enhance your natural beauty.</p><p>But our Matte Lipstick isn\'t just about making a statement with its colors. It also goes the extra mile to care for your