eserve.</p>', 'simple', '1 Item', 400, 70, 8.00, 7.20, 10.00, 0, 0, 0, NULL, 'physical', 0, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 0, 1, NULL, NULL, 'PET05', 0, 'in_stock', 'Fluffy Pet Bed', 'Crafted with high-quality materials, our pet bed is durable and long-lasting, guaranteeing a great investment for pet owners.', 986, 986, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'fluffy-pet-bed', 1, 6, 1, 1, NULL, '2023-09-08 01:49:44', '2023-09-08 01:49:44'),
