(159, 'Striped Cowboy Hat', 'The wide brim of our hat provides excellent coverage, protecting you from harmful UV rays while outdoors.', '<p>This hat is more than just a fashion statement; it\'s a shield against the sun\'s unforgiving rays when you step out into the great outdoors. Crafted with a wide brim, it offers exceptional coverage, ensuring that your face and neck stay safe from the harsh effects of UV rays.</p><p>In the realm of outdoor adventures or even a leisurely walk in the park, sun protection is paramount. Our Striped Cowboy Hat takes this need seriously, providing not only a stylish addition to your outfit but also a dependable defence against sun-related concerns. You can confidently venture into the sun-kissed day, knowing that you have reliable protection accompanying you.</p><p>One of the standout features of our Striped Cowboy Hat is its use of high-quality materials. We believe in delivering excellence through durability and comfort, and this hat is a testament to that commitment. The materials used in crafting this hat ensure that it can withstand the rigors of regular use while keeping you comfortable throughout the day. No compromises are made when it comes to the quality we promise.</p><p>Picture yourself exploring the rugged trails, the wind in your hair, and the sun shining brightly overhead. Now, imagine doing all of that while sporting a hat that not only complements your style but also guards you against the sun\'s harmful rays. Our Striped Cowboy Hat achieves just that - a perfect amalgamation of fashion and functionality. It adds a touch of flair to your attire while being a practical accessory that protects you from the elements.</p><p>Every outing, whether it\'s a hike through the mountains or a leisurely picnic at the beach, requires careful consideration of the elements. Sun protection should be a priority, and with our Striped Cowboy Hat, you don\'t have to choose between safety and style. It embodies the best of both worlds, ensuring you stay safe while looking your best.</p><p>In conclusion, our Striped Cowboy Hat is more than just a hat; it\'s a companion for those who seek adventure, style, and protection. Crafted with precision and care, it promises durability, comfort, and the peace of mind that you\'re shielded from the sun\'s harmful rays. Elevate your outdoor experiences, enhance your style, and prioritize your safety with our professional-grade Striped Cowboy Hat. Choose excellence, choose protection, and choose fashion - choose our Striped Cowboy Hat.</p>', 'simple', '1 Item', 250, 59, 15.00, 14.70, 2.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 0, 1, NULL, NULL, 'FAS12', 0, 'in_stock', 'Striped Cowboy Hat', 'The wide brim of our hat provides excellent coverage, protecting you from harmful UV rays while outdoors.', 1333, 1333, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'striped-cowboy-hat', 1, 15, 1, 1, NULL, '2023-09-18 02:03:55', '2023-09-29 20:24:25'),
(160, 'Solid Hooded Sweatshirt', 'Offering a combination of quality, style, and affordability, the Solid Hooded Sweatshirt provides customers with great value for their money.', '<p>Introducing our Solid Hooded Sweatshirt, the perfect blend of style and comfort for everyone! Whether you\'re heading out for a casual day or hitting the gym, this trendy sweatshirt is a must-have addition to your wardrobe.</p><p>Crafted with high-quality materials, this sweatshirt offers superior durability and long-lasting softness. The hood provides extra protection against the elements, while the relaxed fit ensures freedom of movement. Our Solid Hooded Sweatshirt is designed to keep you cozy and stylish all day long.</p><p>Versatility is key with this sweatshirt. Dress it up with a pair of jeans and sneakers for a laid-back weekend look or layer it under a jacket for added warmth during those chilly evenings. The timeless design and solid color make it easy to match with any outfit, giving you endless styling options.</p><p>We understand the importance of quality, which is why we\'ve paid attention to every detail. From the reinforced stitching to the sturdy zipper, every aspect of this sweatshirt has been carefully considered for your utmost satisfaction. Rest assured, our Solid Hooded Sweatshirt is built to withstand the test of time.</p><p>Whether you\'re a fashion enthusiast or simply looking for a comfortable and stylish everyday essential, our Solid Hooded Sweatshirt is the perfect choice. Join countless satisfied customers and upgrade your wardrobe with this versatile and durable sweatshirt.</p><p>Don\'t miss out on this fantastic opportunity to enhance your fashion game. Order your Solid Hooded Sweatshirt now and experience the perfect blend of fashion and comfort firsthand!</p>', 'classified', '1 Item', 350, 21, 6.00, 5.64, 6.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 0, 1, NULL, NULL, 'FAS05', 1, '