(161, 'Relaxed Fit Hoodie', 'The relaxed fit and versatile design make our hoodie a perfect layering piece for any outfit, adding a touch of warmth and style.', '<p>Introducing our latest addition to the world of fashion and comfort: the Relaxed Fit Hoodie. This versatile piece is designed with the modern individual in mind, offering a perfect blend of style and relaxation. Crafted with utmost precision, this hoodie promises to be your go-to companion for any occasion.</p><p>Our Relaxed Fit Hoodie boasts a thoughtfully chosen fabric that embraces your body with a gentle touch, providing an unparalleled level of comfort. The relaxed fit ensures ease of movement, making it ideal for both lounging at home or stepping out for a casual outing. Its carefully tailored design effortlessly combines functionality and fashion, making it a must-have addition to your wardrobe.</p><p>With its versatile nature, this hoodie effortlessly complements any outfit. Whether you\'re pairing it with your favorite jeans for a laid-back weekend look or layering it with a trendy jacket for a more polished ensemble, this Relaxed Fit Hoodie will elevate your style game and garner compliments wherever you go.</p><p>Not only does this hoodie offer a relaxed fit, but it also features a cozy hood that adds an extra element of comfort. Perfect for those chilly mornings or evening strolls, it provides warmth and protection while exuding an effortlessly cool vibe.</p><p>In addition to its impeccable style, this hoodie is made to withstand the test of time. Its high-quality construction ensures durability, allowing you to enjoy its cozy embrace for years to come. It is also easy to care for, requiring minimal effort to keep it looking pristine.</p><p>Upgrade your wardrobe with our Relaxed Fit Hoodie and experience the perfect blend of fashion and comfort. Embrace leisure without compromising on style. Order now and join countless satisfied customers who have made this hoodie their ultimate fashion staple.</p>', 'classified', '1 Item', 350, 8, 6.00, 5.82, 3.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 0, 1, NULL, NULL, 'FAS06', 1, 'in_stock', 'Relaxed Fit Hoodie', 'The relaxed fit and versatile design make our hoodie a perfect layering piece for any outfit, adding a touch of warmth and style.', 1270, 1270, 1437, 'The delivery time frame is 5-7 days.', 'Hassle free 7, 15 and 30 days return might be available', 0, 1, 1, 1, 1, 'relaxed-fit-hoodie', 1, 15, 1, 1, NULL, '2023-09-18 02:10:17', '2023-09-20 00:42:42'),
