(178, 'Men Gym Co-Ord Set', 'The breathable fabric used in our Men Gym Co-Ord Set allows for proper air circulation, keeping you cool and dry even during intense workouts.', '<p><strong>Unleash Your Fitness Potential with Our Men\'s Gym Co-Ord Set</strong></p><p>Embarking on a fitness journey demands the right companion, and our Men\'s Gym Co-Ord Set is tailored to be just that. Crafted with your comfort at its core, this set is a testament to the perfect blend of style and functionality. Picture yourself in a gym ensemble that not only complements your active lifestyle but enhances your workout experience.</p><p>When we talk about the essence of this gym co-ord set, it starts with the fabric. We\'ve meticulously chosen a high-quality breathable material that prioritizes air circulation. Ensuring you stay cool and dry during your most intense workouts, this fabric is designed to keep you focused on your fitness goals rather than discomfort.</p><p>In the realm of fitness, style isn\'t just an accessory – it\'s an expression. The sleek and modern design of this gym co-ord set is a testament to professionalism in every stitch. It\'s not just gym wear; it\'s a statement of your dedication to an active and healthy life. The set includes both a top and shorts, providing a coordinated look that exudes confidence.</p><p>Flexibility and freedom of movement are non-negotiable when it comes to workout wear. Our Men\'s Gym Co-Ord Set offers just that, allowing you to push your limits, stretch, and strive for more. The fabric is thoughtfully chosen to ensure not only comfort but also durability. It\'s a set that can endure the most rigorous workout sessions, giving you the confidence that your gym wear is up to the challenge.</p><p>Who is this set for? Well, everyone on the fitness spectrum. Whether you\'re a gym enthusiast or a casual fitness buff, this co-ord set is designed for all. Weightlifting, cardio, yoga, or any other fitness activity you\'re into – this set has got your back, quite literally. Its versatility makes it a must-have addition to your workout wardrobe, a go-to for any exercise regimen.</p><p>Investing in your fitness journey is investing in yourself. Elevate your workout experience with our Men\'s Gym Co-Ord Set, where comfort meets style, and functionality embraces fashion. Make a statement, take charge of your fitness goals, and let this exceptional gym co-ord set be your trusted ally. It\'s time to break a sweat and look great doing it!</p>', 'simple', '1 Item', 178, 0, 14.00, 12.60, 10.00, 0, 0, 0, NULL, 'physical', 0, NULL, 24, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 1, 0, 1, '2023-9-1', '2025-10-30', 'FAS22', 1, 'out_of_stock', 'Men Gym Co-Ord Set', 'The breathable fabric used in our Men Gym Co-Ord Set allows for proper air circulation, keeping you cool and dry even during intense workouts.', 1263, 1263, 1437, 'Expect your delivery between 5 and 7 days', 'Hassle free 7, 15 and 30 days return might be available.', 1, 0, 1, 1, 1, 'men-gym-co-ord-set', 1, 15, 19, 1, NULL, '2023-09-18 04:42:13', '2023-09-29 20:24:25'),
