(205, 'Mofi - Bootstrap Admin Dashboard Template', 'Discover Mofi, the feature-packed Bootstrap Admin Dashboard Template. Unleash creativity with Bootstrap 5x, SASS styling, Gulp automation, and a plethora of tools for a seamless admin experience.', '<p>Meet Mofi, the all-encompassing Bootstrap Admin Dashboard Template designed to revolutionize your admin interfaces. With cutting-edge features and a sleek design, Mofi ensures an unparalleled user experience for web developers and administrators alike.</p><p>At the core of Mofi\'s capabilities lies Bootstrap 5x, providing a solid foundation for responsive and mobile-first web development. Seamlessly integrated with SASS for unparalleled styling, Mofi allows users to customize their dashboard with ease. The use of PUG for HTML streamlines the markup process, enhancing code efficiency.</p><p>Gulp, the powerful task runner, is harnessed in Mofi to automate repetitive tasks, allowing developers to focus on creativity rather than manual labor. This, combined with the latest jQuery integration, ensures a dynamic and interactive user interface.</p><p>Mofi doesn\'t stop at mere functionality – it offers four distinct dashboard options, catering to various preferences and purposes. Whether you prefer a light or dark theme or opt for a boxed layout, Mofi provides the flexibility to tailor the dashboard to your unique needs.</p><p>The template boasts an array of color options, allowing users to infuse personality into their admin interfaces. Fully responsive across devices, Mofi adapts seamlessly to different screen sizes, ensuring a consistent and enjoyable user experience.</p><p>Incorporating Font Awesome, Mofi provides an extensive collection of scalable vector icons that enhance the visual appeal of the dashboard. The inclusion of detailed documentation ensures that even beginners can navigate and utilize Mofi\'s features effectively.</p><p>Mofi\'s codebase is a testament to its commitment to cleanliness and efficiency. Well-commented codes make customization and maintenance a breeze. W3C validation guarantees code quality and compliance with web standards.</p><p>For data management, Mofi offers a robust Data Table feature with export options to CSV, Excel, PDF, copy, and print. The template also includes an array of chart options, allowing users to visualize data dynamically.</p><p>Other notable features include multi-file upload functionality, a range slider for precise input selection, and a dedicated Google Fonts integration for diverse typography choices. Form wizards simplify complex form processes, while a chat application enhances communication within the admin interface.</p><p>Mofi\'s comprehensive feature set positions it as a go-to solution for developers and administrators seeking a versatile and powerful Bootstrap Admin Dashboard Template. Whether you\'re a seasoned professional or just starting, Mofi streamlines your workflow and elevates your admin experience to new heights. Embrace the future of web development with Mofi – where functionality meets finesse, and creativity knows no bounds.</p>', 'simple', NULL, NULL, 100, 29.00, 24.36, 16.00, 0, 0, 1, 'https://themeforest.net/item/mofi-angular-admin-dashboard/50309897?s_rank=2', 'digital', 0, 'center', NULL, NULL, NULL, 1, NULL, NULL, NULL, 'url', 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'TEM02', 0, 'in_stock', 'Mofi - Bootstrap Admin Dashboard Template', 'Discover Mofi, the feature-packed Bootstrap Admin Dashboard Template. Unleash creativity with Bootstrap 5x, SASS styling, Gulp automation, and a plethora of tools for a seamless admin experience.', 1686, 1686, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'mofi-bootstrap-admin-dashboard-template', 1, 18, 1, 1, NULL, '2024-03-11 02:14:16', '2024-03-12 04:35:14');
