(208, 'Cion - React JS Admin Dashboard Template', 'Elevate your admin interface with Oslo - Cion, a feature-packed React JS Admin Dashboard Template. Enhance productivity and aesthetics effortlessly.', '<p>Unlock the potential of streamlined administration and unparalleled user experience with Oslo - Cion, a cutting-edge React JS Admin Dashboard Template.</p><p>At the core of Oslo - Cion is its commitment to the latest technologies. Utilizing React-redux-toolkit and incorporating React with TypeScript, the template ensures a robust and efficient development environment. The absence of jQuery and reliance on React hooks underscore its dedication to modern and lightweight solutions.</p><p>The Theme Customizer allows users to tailor the dashboard to their preferences, choosing from Light, Dark, or Box templates, and a variety of color options. This customization extends beyond aesthetics, offering a fully responsive layout that adapts seamlessly to different screen sizes and devices.</p><p>Oslo - Cion boasts a user-friendly interface with an attractive dashboard that facilitates a smooth and intuitive navigation experience. The inclusion of Bookmark Support and Quick Search functionality enhances accessibility, allowing users to find and save crucial information effortlessly.</p><p>In addition to its aesthetic appeal, Oslo - Cion prioritizes functionality. The template integrates various tools and libraries, including image-crop for precise image adjustments, perfect-scrollbar for smooth scrolling, and chart.js and apexcharts for versatile charting options. With 2 Different Dashboards to choose from, users can select the layout that best suits their needs.</p><p>Ensuring a global reach, Oslo - Cion supports Multiple Language options, enabling administrators to cater to diverse audiences. The inclusion of Google Fonts further enhances the design possibilities, allowing for a personalized and polished look.</p><p>One of Oslo - Cion\'s standout features is its comprehensive Data Table functionality. The template allows for easy export of data to CSV, Excel, PDF, as well as Copy and Print options. This, coupled with the Multi-File upload and Range Slider features, makes data management a breeze.</p><p>Developers will appreciate the clean and well-commented codes, ensuring maintainability and ease of understanding. Oslo - Cion is W3C Validated, meeting industry standards for web development. The Detailed Documentation provides a comprehensive guide for both beginners and experienced developers, ensuring a smooth integration process.</p><p>Beyond its foundational features, Oslo - Cion includes advanced elements like Form Wizards and a Chat Application, adding interactive components to the admin dashboard. The inclusion of Font Awesome icons adds a touch of sophistication to the overall design.</p><p>Oslo - Cion is not just a template; it\'s a comprehensive toolkit that empowers administrators and developers to create efficient, visually appealing, and highly functional web applications. Experience the future of admin dashboards with Oslo - Cion and elevate your projects to new heights.</p>', 'simple', NULL, NULL, 100, 24.00, 19.44, 19.00, 0, 0, 1, 'https://themeforest.net/item/cion-vue-nuxt-admin-dashboard-template/50874321', 'digital', 0, 'center', NULL, NULL, NULL, 1, NULL, NULL, NULL, 'url', 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, NULL, NULL, 'TEM05', 0, 'in_stock', 'Cion - React JS Admin Dashboard Template', 'Elevate your admin interface with Oslo - Cion, a feature-packed React JS Admin Dashboard Template. Enhance productivity and aesthetics effortlessly.', 1692, 1692, NULL, NULL, NULL, 1, 1, 1, 1, 1, 'cion-react-js-admin-dashboard-template', 1, 18, 1, 1, NULL, '2024-03-11 02:33:18', '2024-03-12 04:32:56'),
(209, 'Online Organic Food Delivery & Grocery Market React Native App UI Kit - Zomo', 'Elevate your online organic food delivery and grocery market with Zomo—a sleek React Native App UI Kit. MultiLanguage, MultiCurrency, and RTL support make it a game-changer!', '<p>In the dynamic landscape of online grocery businesses, staying ahead is not just a goal—it\'s a necessity. Enter Zomo, the React Native App UI Kit designed to transform your online organic food delivery and grocery market experience. With its extensive feature set, Zomo sets a new standard for efficiency, flexibility, and user-friendly design.</p><p>The first standout feature of Zomo is its robust MultiLanguage support. Recognizing the diverse global market, Zomo ensures that your app caters to a broad audience, breaking language barriers effortlessly. This inclusive approach extends to MultiCurrency support, allowing your customers to transact in their preferred currency, fostering a seamless shopping experience.</p><p>Moreover, Zomo takes user experience to the next level with Right-to-Left (RTL) support. This feature is a game-changer for markets where RTL scripts are prevalent, enhancing readability and navigation for users who prefer or require RTL layouts.</p><p>The aesthetic appeal of Zomo extends beyond functionality, incorporating a sleek Dart-Light Mode. This not only adds a touch of sophistication but also caters to users who prefer a lighter interface. Zomo understands the importance of visual aesthetics in engaging users and provides a modern, clean interface that enhances the overall user experience.</p><p>Efficiency is at the heart of Zomo, and it proudly boasts 1000+ hours saved in development time. This time-saving advantage allows you to focus on refining your business strategy and customer engagement rather than getting bogged down in the intricacies of app development.</p><p>Zomo goes the extra mile with Fields Validation, ensuring that data input is accurate and error-free. This meticulous attention to detail contributes to a smoother user experience, reducing potential frustration for both customers and administrators.</p><p>Behind the scenes, Zomo is built on a foundation of clean and simple code, meticulously crafted and well-documented. With code structured under 70 lines, Zomo ensures that developers can easily navigate, understand, and customize the app to meet specific business needs. This simplicity not only aids in rapid development but also facilitates future updates and maintenance.</p><p>Setting up your online grocery app has never been easier, thanks to Zomo\'s user-friendly interface. The Easy Setup feature ensures that you can launch your app swiftly, without the need for extensive technical expertise. Zomo empowers you to focus on your business strategy and customer engagement, leaving the technicalities to the app framework.</p><p>In conclusion, Zomo stands as a comprehensive solution for anyone venturing into the online organic food delivery and grocery market. Its feature-rich design, coupled with a commitment to simplicity and efficiency, makes it a standout choice for businesses aiming to make a lasting impact in the digital marketplace. Elevate your online grocery business with Zomo—an unparalleled React Native App UI Kit that combines functionality, flexibility, and a touch of elegance.</p><p></p>', 'simple', NULL, NULL, 100, 16.00, 13.60, 15.00, 0, 0, 1, 'https://codecanyon.net/item/online-organic-food-delivery-grocery-market-react-native-app-ui-kit-zomo/46903390?s_rank=1', 'digital', 0, 'center', NULL, NULL, NULL, 1, NULL, NULL, NULL, 'url', 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 1, '2007-3-1', '2026-4-30', 'COD01', 0, 'in_stock', 'Online Organic Food Delivery & Grocery Market React Native App UI Kit - Zomo', 'Elevate your online organic food delivery and grocery market with Zomo—a sleek React Native App UI Kit. MultiLanguage, MultiCurrency, and RTL support make it a game-changer!', 1694, 1694, NULL, NULL, NULL, 1, 1, 1, 1