INSERT INTO `question_and_answers` (`id`, `question`, `answer`, `consumer_id`, `product_id`, `store_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'How can I track my online order?', 'Most online retailers provide a tracking number in your order confirmation email. You can use this number on the carrier\'s website to track the status and location of your package.', 18, 18, 4, '2023-09-28 22:44:56', '2023-09-28 22:45:16', NULL),
(2, 'What is the return policy for most products?', 'Return policies vary by retailer. Typically, there is a specified window (e.g., 30 days) for returns. Check the retailer\'s website or contact customer service for specific details.', 18, 18, 4, '2023-09-28 22:45:48', '2023-09-28 22:46:11', NULL),
(3, 'How do I find the best deals and discounts when shopping online?', 'Subscribe to newsletters, follow retailers on social media, and use price comparison tools. Many retailers also offer discounts for first-time shoppers or during seasonal sales.', 18, 18, 4, '2023-09-28 22:46:56', '2023-09-28 22:47:14', NULL),
(4, 'Are online reviews reliable for making purchasing decisions?', 'Online reviews can be helpful, but it\'s essential to consider the overall sentiment and read multiple reviews. Look for detailed reviews and consider the source\'s credibility.', 18, 16, 4, '2023-09-28 22:51:25', '2023-09-28 22:51:52', NULL),
(5, 'Can I cancel an order after it has been placed?', 'It depends on the retailer and the stage of processing. Quickly contact customer service to inquire about cancellation possibilities.', 18, 16, 4, '2023-09-28 22:52:34', '2023-09-28 22:52:51', NULL),
(6, 'What should I do if a product arrives damaged?', 'Contact the retailer\'s customer service immediately. Most retailers have a process for handling damaged or defective items and may offer a replacement or refund.', 18, 15, 3, '2023-09-28 22:54:11', '2023-09-28 22:54:29', NULL),
(7, 'How can I find out about product recalls?', 'Check the product\'s official website, the manufacturer\'s website, or government websites for recalls. You can also sign up for email alerts from consumer protection organizations.', 18, 10, 4, '2023-09-29 00:05:22', '2023-09-29 00:05:39', NULL);
