(2, 'Daily Dose Supermart', 'At DailyDose Supermart, we believe that every day is an opportunity to nourish your life. Our store is not just a place to shop; it\'s a destination that brings you a daily dose of freshness, quality, and convenience. With a wide range of products spanning groceries, essentials, and more, we are committed to making your daily shopping experience seamless and delightful', 'daily-dose-supermart', 1450, NULL, 840, 3784, 'Newark', '3542 Mahlon Street', '8701', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 3, 1, 1, 1, '2023-08-24 01:34:14', '2023-10-21 22:47:22', NULL),
(3, 'Natures Basket Mart', 'Welcome to Nature\'s Basket Mart, We understand the importance of fresh, nourishing vegetables in your daily diet, and that\'s why we\'ve curated a marketplace that celebrates the vibrancy, flavors, and vitality of farm-fresh produce', 'natures-basket-mart', 1439, NULL, 840, 3787, 'Rochester', '2775 James Street', '14616', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 4, 1, 1, 1, '2023-08-24 01:37:50', '2023-09-29 05:35:05', NULL),
(4, 'Fruits Market', 'Welcome to Fruits Market, your gateway to a world of natural sweetness and vibrant flavors. At FruitE, we celebrate the beauty and goodness of fruits in their purest form', 'fruits-market', 1441, NULL, 840, 3757, 'San Jose', '4105 Park Street', '95110', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 5, 1, 1, 1, '2023-08-24 01:40:33', '2023-09-20 01:38:35', NULL),
(5, 'Trendy Boutique', 'Welcome to our store, your ultimate destination for a harmonious blend of fashion, wellness, and lifestyle essentials. We\'ve curated a space where you can explore a diverse range of products that cater to your body, mind, and living spaces', 'trendy-boutique', NULL, NULL, 840, 3782, 'Las Vegas', '1715 Hiney Road', '89101', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 6, 1, 1, 1, '2023-08-24 01:47:13', '2023-09-18 03:23:12', '2023-09-18 03:23:12'),
(6, 'Pets Provisions', 'Welcome to PetPalate Provisions, where culinary expertise meets pet care. We understand that your furry companions deserve the very best, and that\'s why we\'ve created a haven where their palates and well-being come first', 'pets-provisions', 1456, NULL, 840, 3763, 'Atlanta', '2725 Pine Garden Lane', '30339', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 7, 1, 1, 1, '2023-08-24 01:50:04', '2023-09-22 20:35:08', NULL),
(7, 'Craft Furnishings', 'Welcome to CraftHaven Furnishings, where artistry meets functionality to transform your living spaces into works of beauty and comfort. We understand that your home is a reflection of your personality and style', 'craft-furnishings', 1451, NULL, 840, 3790, 'Toledo', '10 Hill Street', '43615', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 8, 1, 1, 1, '2023-08-24 01:52:32', '2023-09-22 00:53:21', NULL),
(12, 'Hailey Beauty', 'Our Beauty & Skincare products are crafted with premium and carefully selected ingredients, ensuring top-notch quality for the customers. Our Beauty & Skincare line is developed under the guidance and approval of experienced dermatologists, assuring customers of its safety and efficacy.', 'hailey-beauty', 1449, NULL, 840, 3766, 'Chicago', '18 Sugar Land', '60007', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 13, 1, 1, 1, '2023-09-07 00:48:10', '2023-09-22 00:53:01', NULL),
(13, 'Mega Appliances', 'Our Home Appliances & Accessories brand offers a diverse selection of products, ensuring that customers can find exactly what they need for their home.', 'mega-appliances', 1435, NULL, 840, 3800, 'Austin', '36, Baker Street', '73301', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 14, 1, 1, 1, '2023-09-08 01:23:00', '2023-09-19 02:01:41', NULL),
(14, 'Docks Sports', 'Designed with innovative features, our Sports & Accessories help athletes and enthusiasts improve their performance and reach their full potential.', 'docks-sports', 1434, NULL, 840, 3757, 'San Jose', '53B, Claire Street', '94088', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 15, 1, 1, 1, '2023-09-08 01:31:50', '2023-09-19 02:02:34', NULL),
(15, 'Trendy Fashions', 'Our products can be easily paired with different outfits, making them versatile accessories that can be worn for various occasions, from casual to formal events.  Despite the high quality and trendy designs, our Fashion & Accessories are priced competitively, providing customers with great value for their money.', 'trendy-fashions', 1664, NULL, 840, 3759, 'Denver', '26, Starts Hollow Colony', '80014', 'https://www.facebook.com/', 'https://twitter.com/', 'https://www.instagram.com/', NULL, NULL, 0, 0, 16, 1, 1, 1, '2023-09-18 01:14:34', '2024-03-07 23:27:14', NULL),
(16, 'Bonanza Books', 'Books and literature transport us to worlds both real and imaginary, sparking our imagination, empathy, and understanding. They entertain, educate, and inspire, shaping cultures and perspectives across generations.', 'bonanza-books', 1585, NULL, 840, 3800, 'Austin', '18 Sugar Land', '78562', NULL, NULL, NULL, NULL, NULL, 0, 0, 26, 1, 1, 1, '2024-03-04 02:12:18', '2024-03-04 04:59:48', NULL),
(18, 'Code Chronicle', 'Welcome to  Code Chronicle, your tech haven! Dive into a world where every code line tells innovative stories. Explore cutting-edge tools and inventive software solutions in your digital journey toward coding excellence at Code Chronicle!', 'code-chronicle', 1666, NULL, 840, 3784, 'Newark', '18 Sugar Land', '734051', NULL, NULL, NULL, NULL, NULL, 0, 0, 28, 1, 1, 1, '2024-03-07 23:05:32', '2024-03-07 23:27:42', NULL);
