INSERT INTO `tags` (`id`, `name`, `slug`, `type`, `description`, `created_by_id`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Vegetables & Fruits', 'vegetables-fruits', 'product', 'Vegetables and fruits are essential components of a balanced diet, providing a wide range of nutrients, vitamins, and minerals that promote overall health. Vegetables encompass a diverse group of plant-based foods, while fruits are naturally sweet and colorful delights that offer a variety of flavors and health benefits. Incorporating a colorful array of vegetables and fruits into your meals can contribute to improved well-being and support various bodily functions.', 1, 1, '2023-08-24 01:19:47', '2023-08-24 01:19:47', NULL),
(2, 'Beverages', 'beverages', 'product', 'Beverages are liquid refreshments that play a vital role in hydration and enjoyment. They encompass a wide spectrum, from essential options like water and herbal teas to flavorful choices like juices, sodas, coffee, and alcoholic drinks. Beverages can quench thirst, provide essential nutrients, and offer social and cultural significance in various societies. Selecting beverages mindfully can contribute to maintaining proper hydration and aligning with personal health goals.', 1, 1, '2023-08-24 01:20:11', '2023-08-24 01:20:11', NULL),
(3, 'Breakfast & Dairy', 'breakfast-dairy', 'product', 'Breakfast is often hailed as the most important meal of the day, providing a nutritious start to one\'s morning. It typically includes a variety of foods such as grains (like cereal or toast), dairy products like milk, yogurt, and cheese, as well as fruits and proteins. Dairy products, including milk and its derivatives, are rich sources of calcium and essential nutrients that support bone health and overall well-being. Incorporating a balanced breakfast with dairy can provide sustained energy and contribute to a wholesome diet.', 1, 1, '2023-08-24 01:20:26', '2023-08-24 01:20:26', NULL),
(4, 'Frozen Foods', 'frozen-foods', 'product', 'Frozen foods are convenient and versatile food items that have been preserved through freezing. They encompass a wide range of options, from frozen fruits and vegetables to ready-to-eat meals, pizzas, and desserts. Freezing helps lock in nutrients and flavors, extending the shelf life of perishable items. While frozen foods offer convenience, it\'s important to read labels for nutritional information and choose options with balanced ingredients. Properly incorporating frozen foods into a diet can simplify meal preparation while maintaining nutritional value.', 1, 1, '2023-08-24 01:20:39', '2023-08-24 01:20:39', NULL),
(5, 'Biscuits & Snacks', 'biscuits-snacks', 'product', 'Biscuits and snacks are popular food choices enjoyed for their convenience and variety of flavors. Biscuits, often known as cookies in some regions, come in various textures and tastes, from crispy to soft and sweet to savory. Snacks encompass a broader category, including chips, nuts, granola bars, and more, offering quick bites for on-the-go consumption. While indulging in these treats, it\'s important to strike a balance between enjoying their flavors and considering their nutritional content. Opting for healthier snack options can contribute to a well-rounded diet.', 1, 1, '2023-08-24 01:20:52', '2023-08-24 01:20:52', NULL),
(6, 'Grocery & Staples', 'grocery-staples', 'product', 'Groceries and staples are the foundation of a well-stocked kitchen, encompassing essential food items that form the basis of meals. This category includes non-perishable items like rice, pasta, flour, oils, canned goods, and spices. Staples provide the building blocks for a wide range of recipes, allowing for diverse culinary creations. Careful grocery planning ensures a pantry stocked with nutritious and versatile options, enabling efficient meal preparation while accommodating individual dietary preferences.', 1, 1, '2023-08-24 01:21:04', '2023-08-24 01:21:04', NULL),
(7, 'Wines & Soft Drinks', 'wines-soft-drinks', 'product', 'Wines and alcoholic drinks are enjoyed for their diverse flavors and social significance. Wines, produced from fermented grapes, offer a wide range of styles from red to white to rosé, each with unique characteristics. Alcoholic drinks encompass a variety of beverages, including beer, spirits, cocktails, and liqueurs. While moderation can enhance social experiences, it\'s important to be mindful of consumption to avoid negative health effects. Responsible and informed enjoyment of wines and alcoholic drinks can be part of a balanced lifestyle.', 1, 1, '2023-08-24 01:21:24', '2023-08-24 01:21:24', NULL),
(8, 'Pet Shop', 'pet-shop', 'product', 'Our pet shop offers only top-notch, premium quality products, ensuring customer satisfaction and trust. We have a wide variety of pet supplies, including food, toys, grooming essentials, and accessories, catering to every pet owner\'s needs. Our products are reasonably priced, offering great value for money, attracting price-conscious customers.', 1, 1, '2023-08-24 01:21:39', '2023-08-26 02:58:52', NULL),
(9, 'Furniture', 'furniture', 'product', 'Furniture encompasses a wide range of functional and decorative items designed to enhance living and working spaces. It includes various pieces that serve practical purposes while contributing to the overall aesthetics and ambiance of a room or environment. Furniture is an essential aspect of interior design and plays a crucial role in creating comfortable and functional living, working, and recreational spaces.', 1, 1, '2023-08-24 01:21:53', '2023-08-24 01:21:53', NULL),
(10, 'Beauty', 'beauty', 'product', 'Beauty is a concept that encompasses various aspects related to aesthetics, appearance, and the perception of attractiveness. It is a multifaceted idea that can be understood differently across cultures, individuals, and contexts.', 1, 1, '2023-08-24 01:22:11', '2023-08-24 01:22:11', NULL),
(11, 'Fashion', 'fashion', 'product', 'Fashion refers to the prevailing style or trend in clothing, accessories, footwear, makeup, and hairstyling that is popular at a particular time and place. It\'s a dynamic and ever-evolving aspect of culture that reflects social, economic, and cultural influences', 1, 1, '2023-08-24 01:22:24', '2023-08-24 01:22:24', NULL),
(12, 'Meats & Seafood', 'meats-seafood', 'product', 'Meats and seafood are valuable sources of protein, essential nutrients, and distinct flavors in a balanced diet. Meats, which include options like beef, poultry, and pork, offer a range of textures and tastes, while seafood encompasses fish and shellfish with their unique profiles. These foods provide essential amino acids, vitamins, and minerals that support muscle growth, immune function, and overall health. Choosing lean cuts and sustainable seafood options contributes to a nutritious diet while considering environmental and ethical factors.', 1, 1, '2023-08-24 01:22:40', '2023-08-24 01:22:40', NULL),
(13, 'Electronics', 'electronics', 'product', 'Electronics refer to devices and systems that utilize the principles of electronics and electromagnetism to control and manipulate electrical signals. Electronics play a crucial role in modern society, impacting communication, entertainment, transportation, healthcare, and various other sectors', 1, 1, '2023-08-30 22:09:26', '2023-08-30 22:09:26', NULL),
(14, 'Sports', 'sports', 'product', 'Sports encompass a wide range of physical activities and competitive games that involve skill, athleticism, strategy, and often teamwork. Sports have a significant impact on individuals, communities, and societies, fostering physical fitness, social interaction, entertainment, and even professional careers', 1, 1, '2023-08-30 22:09:42', '2023-08-30 22:09:42', NULL),
(15, 'Accessories', 'accessories', 'product', 'Accessories are items that complement and enhance an individual\'s overall appearance and style. They are an essential part of fashion and can add depth, personality, and flair to outfits. Accessories encompass a wide range of items, from jewelry and bags to scarves, hats, belts, and more.', 1, 1, '2023-08-30 22:09:55', '2023-08-30 22:09:55', NULL),
(16, 'Furnishing', 'furnishing', 'post', 'Furniture encompasses a wide range of functional and decorative items designed to enhance living and working spaces. It includes various pieces that serve practical purposes while contributing to the overall aesthetics and ambiance of a room or environment. Furniture is an essential aspect of interior design and plays a crucial role in creating comfortable and functional living, working, and recreational spaces.', 1, 1, '2023-08-30 22:33:10', '2023-08-30 22:33:10', NULL),
(17, 'Fashions', 'fashions', 'post', 'Fashion refers to the prevailing style or trend in clothing, accessories, footwear, makeup, and hairstyling that is popular at a particular time and place. It\'s a dynamic and ever-evolving aspect of culture that reflects social, economic, and cultural influences', 1, 1, '2023-08-30 22:33:21', '2023-08-30 22:33:21', NULL),
(18, 'Groceries', 'groceries', 'post', 'Groceries and staples are the foundation of a well-stocked kitchen, encompassing essential food items that form the basis of meals. This category includes non-perishable items like rice, pasta, flour, oils, canned goods, and spices. Staples provide the building blocks for a wide range of recipes, allowing for diverse culinary creations. Careful grocery planning ensures a pantry stocked with nutritious and versatile options, enabling efficient meal preparation while accommodating individual dietary preferences.', 1, 1, '2023-08-30 22:33:34', '2023-08-30 22:33:34', NULL),
(19, 'Farm Fresh Produce', 'farm-fresh-produce', 'post', 'This unveiling of the farm fresh phenomenon will offer an engrossing insight into the world of pure, unadulterated, and nutrient-rich food. Dive into the lush green fields, feel the raw earth, and unmask the real scent, flavor, and texture that nature imbues in its bountiful produce.', 1, 1, '2023-08-30 22:33:54', '2023-09-01 22:15:07', NULL),
(20, 'Fiction Books', 'fiction-books', 'product', 'Dive into captivating worlds where imagination knows no bounds. Fiction books transport you to realms of wonder, adventure, and emotion. Explore limitless possibilities, from epic fantasies to thought-provoking dramas. Each page unveils new characters, intricate plots, and profound insights into the human experience. Lose yourself in the magic of storytelling and unleash your imagination with every turn of the page.', 1, 1, '2024-03-04 02:15:29', '2024-03-04 02:15:29', NULL),
(21, 'Self-help Books', 'self-help-books', 'product', 'Self-help books offer actionable insights and strategies to enhance personal growth, overcome obstacles, and achieve success. From boosting confidence to mastering productivity, these guides empower individuals to navigate life\'s challenges and unleash their full potential.', 1, 1, '2024-03-04 02:16:07', '2024-03-04 02:16:07', NULL),
(22, 'Poetry Books', 'poetry-books', 'product', 'Discover worlds within words. Dive into the beauty of poetic expression with these captivating poetry books that illuminate the human experience in profound and moving ways.', 1, 1, '2024-03-04 02:21:33', '2024-03-04 02:21:33', NULL),
(23, 'Self-help Books', 'self-help-books-2', 'post', 'Self-help books offer actionable insights and strategies to enhance personal growth, overcome obstacles, and achieve success. From boosting confidence to mastering productivity, these guides empower individuals to navigate life\'s challenges and unleash their full potential.', 1, 1, '2024-03-04 03:58:01', '2024-03-04 03:58:01', NULL);
