o deliver your orders promptly within the estimated delivery window, typically ranging from 5 to 7 days. We understand that sometimes your purchase may not meet your expectations, so we offer a straightforward return policy. If you find yourself unsatisfied with your order, eligible items can be returned within 30 days of purchase, ensuring you have ample time to make a decision. Our commitment is to ensure your satisfaction and convenience throughout your shopping journey with us, and we\'re here to assist you every step of the way.<\\/p><p><strong>Our Shipping Commitment:<\\/strong><\\/p><ul><li><p>Timely and reliable delivery within 5-7 days.<\\/p><\\/li><li><p>Real-time tracking for your orders.<\\/p><\\/li><li><p>Exceptional packaging to ensure your items arrive in perfect condition.<\\/p><\\/li><li><p><\\/p><\\/li><\\/ul><p><strong>Our Hassle-Free Returns:<\\/strong><\\/p><ul><li><p>Eligible items can be returned within 30 days.<\\/p><\\/li><li><p>Easy return initiation through our website.<\\/p><\\/li><li><p>Prompt processing of returns for a hassle-free experience.<\\/p><\\/li><li><p>&nbsp;<\\/p><\\/li><\\/ul><p>We understand that your shopping needs may vary, and we are here to accommodate them while providing exceptional service.<\\/p>\"},\"blog\":{\"blog_style\":\"grid_view\",\"blog_sidebar_type\":\"left_sidebar\",\"blog_author_enable\":true,\"read_more_enable\":true},\"seller\":{\"about\":{\"status\":true,\"title\":\"BECOME A SELLER ON FASTKART...\",\"description\":\"Ready to showcase your products to the world? Join our dynamic marketplace and become a seller at our thriving multipurpose store. With a diverse customer base and a wide range of categories including groceries, fashion, electronics, and more, you\'ll have the perfect platform to reach a vast audience.\\n\\nAs a seller, you\'ll benefit from our user-friendly interface, seamless payment processing, and dedicated support to ensure your products shine. Whether you\'re a local artisan or a growing brand, our store provides the visibility and tools you need to succeed.\\n\\nTap into our established customer traffic, set up your shop with ease, and let your products take center stage. Join us in creating a shopping experience that caters to every need and taste. Your journey to success starts here \\u2013 become a seller at our multipurpose store today!\",\"image_url\":\"\\/storage\\/1478\\/become-seller.jpg\"},\"services\":{\"status\":true,\"title\":\"WHY SELL ON FASTKART ?\",\"service_1\":{\"title\":\"Lowest Cost\",\"description\":\"Unlock quality at the lowest cost, exceeding expectations.\",\"image_url\":\"\\/frontend\\/images\\/data\\/services\\/1.png\"},\"service_2\":{\"title\":\"Lowest Cost\",\"description\":\"Unlock quality at the lowest cost, exceeding expectations.\",\"image_url\":\"\\/frontend\\/images\\/data\\/services\\/2.png\"},\"service_3\":{\"title\":\"Dedicated Pickup\",\"description\":\"Enjoy the convenience of dedicated pickup services for your orders.\",\"image_url\":\"\\/frontend\\/images\\/data\\/services\\/3.png\"},\"service_4\":{\"title\":\"Most Approachable\",\"description\":\"We take pride in being the most approachable choice for your needs.\",\"image_url\":\"\\/frontend\\/images\\/data\\/services\\/4.png\"}},\"steps\":{\"status\":true,\"title\":\"Doing Business On Fastkart Is Really Easy\",\"step_1\":{\"title\":\"List Your Products & Get Support Service Provider\",\"description\":\"Elevate your business by listing your products with us. Experience dedicated support services for your growth.\"},\"step_2\":{\"title\":\"Receive orders & Schedule a pickup\",\"description\":\"Effortlessly receive orders and schedule pickups for ultimate convenience. Your business is simplified.\"},\"step_3\":{\"title\":\"Receive quick payment & grow your business\",\"description\":\"Receive swift payments, fuel the growth of your business seamlessly, and watch your ventures thrive.\"}},\"start_selling\":{\"status\":true,\"title\":\"Start Selling\",\"description\":\"Fastkart marketplace is India\'s leading platform for selling online. Be it a manufacturer, vendor or supplier, simply sell your products online on Fastkart and become a top ecommerce player with minimum investment. Through a team of experts offering exclusive seller workshops, training, seller support and convenient seller portal, Fastkart focuses on educating and empowering sellers across India. Selling on Fastkart.com is easy and absolutely free. All you need is to register, list your catalogue and start selling your products.\"},\"store_layout\":\"basic_store\",\"store_details\":\"basic_store_details\",\"store_image_url\":\"\\/storage\\/1981\\/Screenshot-from-2024-04-15-10-36-43.png\"},\"contact_us\":{\"contact_image_url\":\"\\/frontend\\/images\\/data\\/contact-us.png\",\"detail_1\":{\"label\":\"Phone\",\"icon\":\"ri-phone-line\",\"text\":\"(+1) 618 190 496\"},\"detail_2\":{\"label\":\"Email\",\"icon\":\"ri-mail-line\",\"text\":\"support@fastkart.com\"},\"detail_3\":{\"label\":\"London Office\",\"icon\":\"ri-map-pin-line\",\"text\":\"Cruce Casa de Postas 29\"},\"detail_4\":{\"label\":\"Bournemouth Office\",\"icon\":\"ri-building-line\",\"text\":\"Visitaci\\u00f3n de la Encina 22\"},\"imageUrl\":null},\"about_us\":{\"about\":{\"status\":true,\"content_left_image_url\":\"\\/storage\\/1480\\/about_1.jpg\",\"content_right_image_url\":\"\\/storage\\/1481\\/about_2.jpg\",\"sub_title\":\"About Us\",\"title\":\"We Make Organic Food In Market\",\"description\":\"Just a few seconds to measure your body temperature. Up to 5 users! The battery lasts up to 2 years. There are many variations of passages of Lorem Ipsum available.We started in 2019 and haven\'t stopped smashing it since. A global brand that doesn\'t sleep, we are 24\\/7 and always bringing something new with over 100 new products dropping on the monhtly, bringing you the latest looks for less.\",\"futures\":[{\"icon\":\"\\/storage\\/1484\\/delivery.svg\",\"title\":\"Free delivery for all orders\"},{\"icon\":\"\\/storage\\/1483\\/leaf.svg\",\"title\":\"Only fresh foods\"}]},\"clients\":{\"status\":true,\"sub_title\":\"What We Do\",\"title\":\"We Are Trusted By Clients\",\"content\":[{\"icon\":\"\\/storage\\/1488\\/buy.svg\",\"title\":\"Products Sales\",\"description\":\"Some coffee shops have a seating area, while some just have a spot to order and then go somewhere else to sit down. The coffee shop that I am going to.\"},{\"icon\":\"\\/storage\\/1487\\/work.svg\",\"title\":\"Business Years\",\"description\":\"A coffee shop is a small business that sells coffee, pastries, and other morning goods. There are many different types of coffee shops around the world.\"},{\"icon\":\"\\/storage\\/1486\\/user.svg\",\"title\":\"Happy Customers\",\"description\":\"My goal for this coffee shop is to be able to get a coffee and get on with my day. It\'s a Thursday morning and I am rushing between meetings.\"}]},\"team\":{\"status\":true,\"sub_title\":\"Our Creative Team Fastkart\",\"title\":\"Fastkart Team Member\",\"members\":[{\"profile_image_url\":\"\\/storage\\/1490\\/user_4.jpg\",\"name\":\"Betty J. Turner\",\"designation\":\"CEO, Company\",\"description\":\"Fondue stinking bishop goat. Macaroni cheese croque monsieur cottage cheese.\",\"instagram\":\"https:\\/\\/instagram.com\\/\",\"twitter\":\"https:\\/\\/twitter.com\\/\",\"pinterest\":\"https:\\/\\/pinterest.com\\/\",\"facebook\":\"https:\\/\\/www.facebook.com\\/\"},{\"profile_image_url\":\"\\/storage\\/1492\\/user_6.jpg\",\"name\":\"Alfredo S. Rocha\",\"designation\":\"Sr. Project Manager\",\"description\":\"camembert de normandie. Bocconcini rubber cheese fromage frais port-salut.\",\"instagram\":\"https:\\/\\/instagram.com\\/\",\"twitter\":\"https:\\/\\/twitter.com\\/\",\"pinterest\":\"https:\\/\\/pinterest.com\\/\",\"facebook\":\"https:\\/\\/www.facebook.com\\/\"},{\"profile_image_url\":\"\\/storage\\/1491\\/user_3.jpg\",\"name\":\"Constance K. Whang\",\"designation\":\"Jr. Project Manager\",\"description\":\"